INSERT INTO `t_han_etymology` VALUES (1, '天', '顯坦', '天，豫 司 兖 冀以舌腹言之，天，顯也，在上高顯也。靑 徐以舌頭言之，天，坦也，坦然高而遠也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (2, '蒼天', '', '春曰蒼天，陽氣始發，色蒼蒼也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (3, '昊天', '顥', '夏曰昊天，其氣布散顥顥也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (4, '旻天', '閔', '秋曰旻天，旻，閔也，物就枯落可閔傷也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (5, '上天', '', '冬曰上天，其氣上騰，與地絕也，故月令曰：「天氣上騰，地氣下降。」', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (6, '乾', '健', '天，易謂之乾，乾，健也，健行不息也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (7, '玄', '縣', '天，又謂之玄，玄，縣也，如縣物在上也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (8, '日', '實', '日，實也，光明盛實也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (9, '月', '闕', '月，闕也，滿則闕也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (10, '光', '晃廣', '光，晃也，晃晃然也。亦言廣也，所照廣遠也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (11, '景', '竟', '景，竟也，所照處有竟限也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (12, '晷', '規', '晷，規也，如規畫也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (13, '燿', '', '曜，耀也，光明照耀也。', '釋天第一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (14, '星', '散', '星，散也，列位布散也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (15, '宿', '', '宿，宿也，星各止宿其處也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (16, '气', '愾', '氣，愾也，愾然有聲而無形也。', '釋天第一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (17, '風', '氾放', '風，豫 司 兖 冀橫口合唇言之，風，氾也，其氣博氾而動物也。靑 徐言風，踧口開唇推氣言之，風，放也，氣放散也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (18, '陰', '蔭', '陰，蔭也，氣在內奧蔭也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (19, '陽', '揚', '陽，揚也，氣在外發揚也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (20, '寒', '扞', '寒，扞也，扞格也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (21, '暑', '煮', '暑，煮也，熱如煮物也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (22, '熱', '爇', '熱，爇也，如火所燒爇也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (23, '雨', '羽', '雨，羽也，雨水從雲下，如鳥羽動則散也。亦言輔也，言輔時生養也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (24, '春', '蠢', '春，蠢也，物蠢動而生也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (25, '夏', '叚', '夏，假[叚]也，寬假萬物，使生長也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (26, '秋', '逎', '秋，緧[逎]也，緧迫品物，使時成也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (27, '冬', '終', '冬，終也，物終成也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (28, '四時', '稘', '四時，四方各一時也。時，期[稘]也，物之生死，各應節期而止也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (29, '歲', '越', '歲，越也，越故限也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (30, '年', '進', '年，進也，進而前也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (31, '載', '', '唐、虞曰載，載生物也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (32, '祀', '巳', '殷曰祀，祀，巳也，新氣升故氣巳也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (33, '五行', '', '五行者，五氣也，於其方各施行也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (34, '金', '禁', '金，禁也，氣剛巖能禁制物也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (35, '木', '冒', '木，冒也，華葉自覆冒也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (36, '水', '凖', '水，凖也，凖平物也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (37, '火', '𠤎燬', '火，化[𠤎]也，消化物也。亦言毀[燬]也，物入中皆毀壞也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (38, '土', '吐', '土，吐也，能吐生萬物也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (39, '子', '孳', '子，孳也，陽氣始萌，孳生於下也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (40, '坎', '險', '子，於易爲坎，坎，險也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (41, '丑', '紐', '丑，紐也，寒氣自屈紐也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (42, '艮', '限', '丑，於易爲艮，艮，限也，時未可聽物生，限止之也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (43, '寅', '演', '寅，演也，演生物也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (44, '卯', '冒', '卯，冒也，載冒土而出也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (45, '震', '', '卯，於易爲震，二月之時，雷始震也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (46, '辰', '伸', '辰，伸也，物皆伸舒而出也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (47, '巳', '', '巳，巳也，陽氣畢布巳也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (48, '巽', '散', '巳，於易爲巽，巽，散也，物皆生布散也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (49, '午', '啎', '午，仵[啎]也，陰氣從下上，與陽相仵逆也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (50, '離', '麗', '午，於易爲離，離，麗也，物皆附麗陽氣以茂也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (51, '未', '昧', '未，昧也，日中則昃，向幽昧也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (52, '申', '身', '申，身也，物皆成其身體也，亦言各申束之，使備成也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (53, '酉', '秀', '酉，秀也，秀則物皆成也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (54, '兌', '說', '酉，於易爲兌，兌，說也，物得備足，皆喜說也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (55, '戌', '恤挩', '戌，恤也，物當收斂，矜恤之也。亦言脫[挩]也，物脫落也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (56, '亥', '核', '亥，核也，收藏百物，核取其好惡、眞僞也。亦言物成皆堅核也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (57, '甲', '', '甲，孚甲也，萬物解孚甲而生也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (58, '乙', '軋', '乙，軋也，自抽軋而出也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (59, '丙', '炳', '丙，炳也，物生炳然，皆著見也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (60, '丁', '壯', '丁，壯也，物體皆丁壯也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (61, '戊', '茂', '戊，茂也，物皆茂盛也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (62, '己', '紀', '己，紀也，皆有定形，可紀識也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (63, '庚', '更', '庚猶更也。更，堅强貌也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (64, '辛', '新', '辛，新也，物初新者，皆收成也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (65, '壬', '妊', '壬，妊也，陰陽交，物懷妊，至子而萌也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (66, '癸', '揆', '癸，揆也，揆度而生，乃出土也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (67, '霜', '喪', '霜，喪也，其氣慘毒，物皆喪也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (68, '露', '慮', '露，慮也，覆慮物也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (69, '雪', '綏', '雪，綏也，水下遇寒氣而凝，綏綏然也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (70, '霰', '星', '霰，星也，水雪相搏，如星而散也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (71, '霢霂', '沐', '霢霂，小雨也，言裁霢歷霑漬，如人沐頭，惟及其上枝，而根不濡也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (72, '雲', '云運', '雲猶云云，眾盛意也。又言運也，若運行也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (73, '雷', '硍', '雷，硠[硍]也，如轉物有所硠雷之聲也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (74, '電', '殄', '電，殄也，乍見則殄滅也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (75, '震', '戰', '震，戰也，所擊輒破，若攻戰也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (76, '辟歷', '', '震，又曰辟歷，辟，析也，所歷皆破析也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (77, '雹', '儦', '雹，跑[儦]也，其所中物皆摧折，如人所蹴跑也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (78, '虹', '攻', '虹，陽氣之動也。虹，攻也，純陽攻陰氣也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (79, '蝃蝀', '歠東', '虹，又曰蝃蝀，其見每於日在西而見於東，掇[歠]飲東方之水氣也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (80, '升朝', '', '虹，見於西方曰升朝，日始升而岀見也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (81, '美人', '', '虹，又曰美人，陰陽不和，婚姻錯亂，淫風流行，男美於女，女美於男，互相奔隨之時，則此氣盛，故以其盛時名之也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (82, '霓', '齧', '霓，齧也，其體斷絕，見於非時，此災氣也，傷害於物，如有所蝕齧也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (83, '暈', '捲', '暈，捲也，氣在外捲結之也，日月俱然。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (84, '曀', '翳', '陰而風曰曀，曀，翳也，言雲氣掩翳日光，使不明也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (85, '霾', '晦', '風而雨土曰霾，霾，晦也，言如物塵晦之色也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (86, '珥', '耳', '珥，氣在日兩旁之名也。珥，耳也，言似人耳之在面旁也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (87, '𧐂', '食', '日月虧曰蝕，稍稍侵虧，如蟲蝕[食]草木葉也。', '釋天第一', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (88, '朏', '', '朏，月未成明也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (89, '霸', '', '霸，月始生霸然也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (90, '晦', '灰', '晦，月盡之名也。晦，灰也，火死爲灰，月光盡似之也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (91, '朔', '蘇', '朔，月始之名也。朔，蘇也，月死復蘇生也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (92, '弦', '', '弦，月半之名也。其形一旁曲、一旁直，若張弓施弦也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (93, '朢', '望', '望，月滿之名也。月大十六日、小十五日，日在東、月在西，遙相望也。', '釋天第一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (94, '昏', '損', '昏，損也，陽精損滅也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (95, '晨', '伸', '晨，伸也，旦而日光復伸見也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (96, '祲', '侵', '祲，侵也，赤黑之氣相侵也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (97, '氛', '粉', '雰，粉也，潤氣著草木，因寒凍凝，色白若粉之形也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (98, '霚', '冒', '霚，冒也，氣蒙亂、覆冒物也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (99, '冡', '', '蒙，日光不明，蒙蒙然也。', '釋天第一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (100, '彗星', '', '彗星，星光梢似彗也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (101, '孛星', '', '孛星，星旁氣孛孛然也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (102, '筆星', '銳', '筆星，星氣有一枝，末銳似筆也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (103, '流星', '', '流星，星轉行如流水也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (104, '枉矢', '光', '流星，又曰枉矢，齊魯謂光景爲枉，言其光行若射矢之所至也；亦言其氣枉暴，有所災害也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (105, '厲', '', '厲，厲也，疾氣中人如磨厲傷物也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (106, '疫', '役', '疫，役也，言有鬼行役也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (107, '札', '𢧵', '札，𢧵也，氣傷人如有所斷𢧵也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (108, '𡿧', '烖', '災，烖也，火所燒滅之余曰烖，言其於物如是也。', '釋天第一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (109, '害', '割', '害，割也，如割削物也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (110, '異', '', '異，言異於常也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (111, '眚', '省', '眚，省也，如病者省瘦也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (112, '𢘋', '態', '慝，態也，有姦態也。', '釋天第一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (113, '䄏', '夭', '妖，殀[夭]也，殀害物也。', '釋天第一', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (114, '蠥', '隉', '蠥，蘖也，遇之如物見髡蘖[阢隉]也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (115, '伏', '', '伏伏者何？金氣伏藏之日。金畏火，故三伏皆庚日。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (116, '霄', '', '霄霄，青天也，無雲氣而青碧者也。又曰近天氣也。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (117, '霞', '叚', '霞霞，白雲映日光而成赤色，假日之赤光而成也，故字从雨，叚聲。', '釋天第一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (118, '霿', '冡', '霿霿，蒙[冡]也，日光不明蒙蒙然也。', '釋天第一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (119, '地', '底諦', '地，底也，其體底下，載萬物也。亦言諦也，五土所生，莫不信諦也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (120, '坤', '順', '地，易謂之坤。坤，順也，上順乾也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (121, '土', '吐', '土，吐也，吐生萬物也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (122, '田', '塡', '巳耕者曰田。田，塡也，五稼塡滿其中也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (123, '壤', '䑋', '壤，䑋也；䑋䑋，肥濡意也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (124, '原', '元', '廣平曰原。原，元也，如元氣廣大也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (125, '陸', '漉', '高平曰陸。陸，漉也，水流漉而去也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (126, '衍', '', '下平曰衍，言漫衍也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (127, '隰', '墊', '下溼曰隰。隰，墊也；墊溼意也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (128, '澤', '', '下而有水曰澤，言潤澤也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (129, '鹵', '爐', '地不生物曰鹵。鹵，爐也，如爐火處也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (130, '黎', '藜', '徐州贡土五色，有青、黄、赤、白、黑也。土青曰黎，似藜草色也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (131, '埴', '殖', '土黄而細密曰埴。埴，膱[殖]也，黏胒如脂之膱也。', '釋地第二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (132, '鼠肝', '', '土赤曰鼠肝，似鼠肝色也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (133, '漂', '', '土白曰漂，漂，輕飛散也。', '釋地第二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (134, '黸', '壚', '土黑曰盧，盧[壚]然解散也。', '釋地第二', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (135, '山', '產', '山，產也，產生物也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (136, '𨸏', '', '土山曰阜。阜，厚也，言高厚也。', '釋山第三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (137, '陵', '隆', '大阜曰陵。陵，隆也，體隆高也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (138, '冢', '腫', '山頂曰冢。冢，腫也，言腫起也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (139, '陂', '', '山旁曰陂，言陂陁也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (140, '岡', '亢', '山脊曰岡。岡，亢也，在上之言也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (141, '涌', '桶', '山旁隴閒曰涌。涌猶桶，桶狹而長也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (142, '崇', '竦', '山大而高曰嵩。嵩，竦也，亦高稱也。', '釋山第三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (143, '岑', '磛', '山小而高曰岑。岑，嶃[磛]也，嶃嶃然也。', '釋山第三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (144, '喬', '橋', '山銳而長曰橋，形似橋也。', '釋山第三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (145, '甗', '', '山上大下小曰甗。甗，甑一孔者，甗形孤出處似之也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (146, '嶅', '堯', '山多小石曰磝。磝，堯也，每石堯堯，獨處而出見也。', '釋山第三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (147, '嶨', '學', '山多大石曰礐。礐，學也，大石之形，學學然也。', '釋山第三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (148, '岵', '怙', '山有草木曰岵。岵，怙也，人所怙取，以爲事用也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (149, '屺', '圮', '山無草木曰屺。屺，圮也，圮壞無所岀生也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (150, '埒', '捝', '山上有水曰埒。埒，脫[捝]也，脫而下流也。', '釋山第三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (151, '岨', '臚', '石載土曰岨。岨，臚然也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (152, '崔嵬', '', '土載石曰崔嵬，因形名之也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (153, '朝陽夕陽', '照', '山東曰朝陽，山西曰夕陽。隨日所照而名之也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (154, '𡿨', '吮', '山下根之受霤處曰甽。甽，吮也，吮得山之肥潤也。', '釋山第三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (155, '林', '森', '山中叢木曰林。林，森也，森森然也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (156, '麓', '陸', '山足曰麓。麓，陸也，言水流順陸燥也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (157, '石', '格', '山體曰石。石，格也，堅扞格也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (158, '礫', '料', '小石曰礫。礫，料也，小石相枝柱其閒，料料然岀內氣也。', '釋山第三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (159, '瀆', '獨', '天下大水四，謂之四瀆，江、河、淮、濟是也。瀆，獨也，各獨出其所而入海也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (160, '江', '公', '江，公也，諸水流入其中所公共也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (161, '淮', '圍', '淮，圍也，圍繞揚州北界，東至海也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (162, '河', '下', '河，下也，隨地下處而通流也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (163, '濟', '', '濟，濟也，言源岀河北濟河而南也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (164, '川', '穿', '川，穿也，穿地而流也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (165, '㵎', '閒', '山夾水曰㵎。㵎，閒也，言在兩山之閒也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (166, '濫', '銜', '水正出曰濫泉。濫，銜也，如人口有所銜，口闓則見也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (167, '沃泉', '', '縣岀曰沃泉，水從上下，有所灌沃也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (168, '氿泉', '軌', '側出曰氿泉。氿，軌也，流狹而長，如車軌也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (169, '肥泉', '', '所出同、所歸異曰肥泉，本同出時所浸潤少，所歸各枝散而多，似肥者也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (170, '邕沛涌泉濆泉', '', '水從河出曰雍沛，言在河岸限內，時見雍岀，則沛然也。水上出曰涌泉、濆泉并是也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (171, '唐', '掌', '水泆出所爲澤曰掌，水停處如手掌中也。今兖州人謂(澤)[唐]曰掌也。', '釋水第四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (172, '汜', '巳', '水決復入爲汜。汜，巳也，如出有所爲，畢巳而還入也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (173, '瀾', '連', '風行水波成文曰瀾。瀾，連也，波體轉流相及連也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (174, '淪', '侖', '水小波曰淪。淪，倫[侖]也，水文相次有倫理也。', '釋水第四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (175, '涇', '徑', '水直波曰涇。涇，徑也，言如道徑也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (176, '湄', '眉', '水草交曰湄。湄，眉也，臨水如眉臨目也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (177, '海', '晦', '水經川所歸之處曰海。海，晦也，主承穢濁，其色黑而晦也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (178, '溝', '冓', '水注谷曰溝。田閒之水亦曰溝，溝，搆[冓]也，從橫相交搆也。', '釋水第四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (179, '澮', '會', '注溝曰澮。澮，會也，小溝之所聚會也　。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (180, '州', '聚', '水中可居者曰洲。洲，聚也，人及鳥物所聚息之處也。', '釋水第四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (181, '渚', '遮', '小洲曰渚。渚，遮也，體高能遮水，使從旁回也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (182, '沚', '止', '小渚曰沚。沚，止也，小可以止息其上也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (183, '坻', '遲', '小沚曰坻。泜，遲也，能遏水使流遲也。', '釋水第四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (184, '潏', '術', '人所爲之曰潏。潏，術也，偃水使鬱術也，魚梁、水碓之謂也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (185, '㠀', '到鳥', '海中可居者曰㠀。㠀，到也，人所奔到也。亦言鳥也，人物所趣如鳥之下也。', '釋水第四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (186, '頓丘', '', '丘一成曰頓丘，一頓而成，無上下大小之殺也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (187, '陶丘', '', '再成曰陶丘，於高山上一重作之，如陶竈然也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (188, '昆侖丘', '', '三成曰崑崙丘，如崑崙之高而積重也。', '釋丘第五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (189, '嵍丘', '髦', '前高曰髦丘，如馬舉頭垂髦也。', '釋丘第五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (190, '宛丘陘丘', '', '中央下曰宛丘，有丘宛宛如偃器也。上有一泉水曰陘丘，亦是也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (191, '阿丘', '何', '偏高曰阿丘，阿，何也，如人儋何物，一邊偏高也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (192, '畮丘', '', '畝丘，丘體滿一畝之地也。', '釋丘第五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (193, '圜丘方丘', '', '圜丘、方丘，就其方圜名之也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (194, '融丘', '', '銳上曰融丘。融，明也；明，陽也，凡上銳皆高而近陽者也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (195, '乘丘', '', '如乘者曰乘丘。四馬曰乘，一基在後似車，四列在前似駕馬之形也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (196, '陼丘', '', '如陼者曰陼丘，形似水中之高地，隆高而廣也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (197, '屔丘', '', '水潦所止曰泥丘，其止汙水，畱不去成泥也。', '釋丘第五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (198, '都丘', '', '澤中有丘曰都丘，言蟲鳥往所都聚也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (199, '梧丘', '啎', '當途曰梧丘。梧，忤[啎]也，與人相當忤也。', '釋丘第五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (200, '畫丘', '', '道岀其右曰畫丘，人尙右，凡有指畫皆用右也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (201, '載丘', '', '道出其前曰載丘，在前故言載也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (202, '昌丘', '', '道岀其後曰昌丘。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (203, '[渻丘]', '', '其前曰阯丘，阯，基阯也，言所出然。', '釋丘第五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (204, '阻丘', '', '水岀其後曰阻丘，背水以爲險也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (205, '沚丘', '止', '水岀其右曰沚丘。沚，止也，西方義氣有所制止也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (206, '營丘', '', '水出其左曰營丘。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (207, '陽丘', '', '丘高曰陽丘，體高近陽也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (208, '宗丘', '', '宗丘，邑中所宗也。', '釋丘第五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (209, '道路', '蹈露', '道一達曰道路。道，蹈也。路，露也，言人所踐蹈而露見也。', '釋道第六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (210, '岐旁', '', '二達曰岐旁。物兩爲岐，在邊曰旁，此道並通出似之也。', '釋道第六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (211, '勮旁', '', '三達曰劇旁。古者列樹以表道，道有夾溝，以通水潦，恒見修治，此道旁轉多，用功稍劇也。', '釋道第六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (212, '衢', '𣚏', '四達曰衢。齊魯謂四齒杷爲欋[𣚏]，欋杷地則有四處，此道似之也。', '釋道第六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (213, '康', '', '五達曰康。康，昌也，昌盛也。車步併列並用之，言充盛也。', '釋道第六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (214, '莊', '裝', '六達曰莊。莊，裝也，裝其上使高也。', '釋道第六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (215, '勮驂', '', '七達曰劇驂。驂馬有四耳，今此道有七，比於劇也。', '釋道第六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (216, '崇期', '充', '八達曰崇期。崇，充也，道多所通，人充滿其上，如共期也。', '釋道第六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (217, '馗', '', '九達曰逵。齊魯謂道多爲逵師，此形然也。', '釋道第六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (218, '豪', '翱', '城下道曰䧫，䧫，翱也，言都邑之內翱翔，祖駕之處也。', '釋道第六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (219, '徯', '係', '步所用道曰蹊。蹊，係也，言射疾則用之，故還係於正道也。', '釋道第六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (220, '徑', '經', '徑，經也，人所經由也。', '釋道第六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (221, '迒', '㽘', '鹿兔之道曰亢，行不由正，如亢陌[㽘佰]山谷草野而過也。', '釋道第六', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (222, '涂', '度', '涂，度也，人所由得通度也。', '釋道第六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (223, '州', '注', '州，注也，郡國所注仰也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (224, '靑州', '', '靑州在東，取物生而靑也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (225, '徐州', '舒', '徐州，徐，舒也，土氣舒緩也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (226, '揚州', '', '揚州，州界多水，水波揚也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (227, '荆州', '警', '荆州，取名於荆山也。必取荆爲名者，荆，警也，南蠻數爲宼逆，其民有道後服，無道先彊，常警備之也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (228, '豫州', '', '豫州，地在九州之中，京師東都所在，常安豫也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (229, '涼州', '', '涼州，西方所在，寒涼也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (230, '雝州', '翳', '涼州，古曰雍州，在四山之內，雍，翳也。', '釋州國第七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (231, '并州', '', '并州，并，兼并也。其州或并或設，故因以爲名也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (232, '幽州', '', '幽州，在北幽昧之地也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (233, '冀州', '易', '冀州，亦取地以爲名也。冀，易也。其地有險有易也，又帝王所都，亂則冀治，弱則冀彊，荒則冀豐也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (234, '沇州', '', '兖州，取兖水以爲名也。', '釋州國第七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (235, '司州', '', '司州，司隸校尉所主也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (236, '益州', '阸', '益州，益，阨[阸]也，所在之地險阨也。', '釋州國第七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (237, '營州', '', '古有營州，齊衞之地於天文屬營室，取其名也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (238, '燕', '宛', '燕，宛也，北方沙漠平廣，此地在涿鹿山南，宛宛然以爲國都也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (239, '宋', '送', '宋，送也，地接淮泗而東南傾，以爲殷後，若云滓穢所在，送使隨流東入海也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (240, '鄭', '汀', '鄭，町[汀]也，其地多平，町町然也。', '釋州國第七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (241, '楚', '', '楚，辛楚也，其地蠻多而人性急，數有戰爭，相爭相害，辛楚之禍也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (242, '周', '', '周，周也，地在岐山之南，其山四周也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (243, '秦', '𧗁', '秦，津[𧗁]也，其地沃衍，有津潤也。', '釋州國第七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (244, '晉', '進', '晉，進也，其地在北，有事於中國，則進而南也；又取晉水以爲名，其水迅進也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (245, '趙', '𣶃', '趙，朝[𣶃]也，本小邑，朝事於大國也。', '釋州國第七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (246, '魯', '', '魯，魯鈍也，國多山水，民性樸魯也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (247, '衞', '', '衞，衞也，旣滅殷，立武庚爲殷後，三監以守衞之也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (248, '齊', '', '齊，齊也，地在勃海之南，如齊之中也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (249, '吴', '', '吴，虞也，太伯讓位而不歸，就封之於此，虞其志也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (250, '越', '', '越，夷蠻之國，度越禮義，無所拘也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (251, '河南', '', '河南，在河之南也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (252, '河內', '', '河內，河水從岐山而南，從雷首而東，從覃懷而北，郡在其內也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (253, '河東', '', '河東，在河水東也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (254, '河西', '', '河西，在河水西也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (255, '上黨', '', '上黨，黨，所也，在山上，其所最高，故曰上黨也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (256, '潁川', '', '潁川，因潁水爲名也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (257, '汝南', '', '汝南，在汝水南也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (258, '汝陰', '', '汝陰，在汝水陰也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (259, '東郡南郡', '', '東郡、南郡，皆以京師方面言之也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (260, '北海', '', '北海，海在其北也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (261, '西海', '', '西海，海在其西也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (262, '南海', '', '南海，在海南也，宜言海南，欲同四海名，故言南海也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (263, '東海', '', '東海，海在其東也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (264, '濟南', '', '濟南，濟水在其南也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (265, '濟北', '', '濟北，濟水在其北也，義亦如南海也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (266, '濟陰', '', '濟陰，在濟水之陰也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (267, '南陽', '', '南陽，在中國之南，而居陽地，故以爲名也。凡若此類郡國之名，取號於此，則其餘可知也。縣邑之名亦如之。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (268, '邦', '封', '大邑曰邦，邦，封也，封有功於是也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (269, '都', '', '國城曰都，都者，國君所居，人所都會也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (270, '井', '', '周制：九夫爲井。其制似井字也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (271, '邑', '挹', '周制：四井爲邑，邑猶挹也，邑人聚會之稱也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (272, '丘', '', '周制：四邑爲丘。丘，聚也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (273, '甸', '乘', '周制：四丘爲甸。甸，乘也，出兵車一乘也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (274, '鄙', '否', '鄙，否也，小邑不能遠通也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (275, '縣', '', '縣，縣也，縣係於郡也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (276, '郡', '羣', '郡，羣也，人所羣聚也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (277, '伍', '五', '周制：五家爲伍，以五爲名也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (278, '鄰', '連', '周制：五家爲鄰。鄰，連也，相接連也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (279, '比', '', '周制：五家爲比。比，相親比也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (280, '里', '', '周制：五鄰爲里。居方一里之中也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (281, '黨', '長', '周制：五百家爲黨。黨，長也，一聚之所尊長也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (282, '鄕', '向', '周制：萬二千五百家爲鄕。鄕，向也，衆所向也。', '釋州國第七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (283, '人', '仁', '人，仁也，仁生物也，故易曰：「立人之道曰仁與義。」。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (284, '體', '第', '體，第也，骨肉、毛血、表裏、大小相次第也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (285, '軀', '區', '軀，區也，是衆名之大總，若區域也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (286, '形', '', '形，有形象之異也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (287, '身', '伸', '身，伸也，可屈伸也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (288, '毛', '皃', '毛，貌[皃]也，冒也，在表所以別形貌，且以自覆冒也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (289, '皮', '', '皮，被也，被覆體也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (290, '膚', '布', '膚，布也，布在表也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (291, '肌', '垍', '肌，懻[垍]也，膚幕堅懻也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (292, '骨', '滑', '骨，滑也，骨堅而滑也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (293, '胑', '枝', '胑，枝也，似木之枝格也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (294, '肉', '柔', '肉，柔也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (295, '筋', '靳', '筋，靳也，肉中之力，氣之元，靳固於身形也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (296, '膜', '幕', '膜，幕也，幕絡一體也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (297, '血', '濊', '血，濊也，岀於肉，流而濊濊也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (298, '膿', '醲', '膿，醲也，汁醲厚也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (299, '汁', '', '汁，涕也，汁涕涕而出也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (300, '𧗁', '進', '津，進也，汁進出也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (301, '汋', '澤', '汋，澤也，有潤澤也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (302, '汗', '扞', '汗，𣵡[扞]也，岀在於表，𣵡𣵡然也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (303, '髓', '殨', '髓，瀢[殨]也，瀢瀢然也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (304, '髪', '拔', '髪，拔也，拔擢而生也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (305, '𦥓', '峻', '𦥓，峻也，所生高峻也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (306, '髦', '冒', '髦，冒也，覆冒頭頸也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (307, '眉', '媚', '眉，媚也，有嫵媚也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (308, '頭', '獨', '頭，獨也，於體高而獨也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (309, '首', '', '首，始也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (310, '面', '漫', '面，漫也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (311, '額', '㖾', '額，鄂[㖾]也，有垠鄂也，故幽州人謂之鄂也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (312, '角', '', '角，生於額角也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (313, '頞', '鞍', '頞，鞍也，偃折如鞍也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (314, '目', '默', '目，默也，默而內識也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (315, '眼', '限', '眼，限也，童子限限而出也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (316, '䀹', '插接', '睫，插也、接也，插於眼匡而相接也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (317, '童子', '重', '童子，童，重也，膚幕相裹重也。子，小稱也，主謂其精明者也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (318, '牟子', '冒', '瞳子，一曰眸子。眸，冒也，相裹冒也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (319, '自', '嘒', '鼻，嘒也，岀氣嘒嘒也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (320, '口', '', '口，空也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (321, '頰', '夾', '頰，夾也，面旁稱也；亦取挾斂食物也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (322, '舌', '渫', '舌，泄[渫]也，舒泄所當言也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (323, '齒', '始', '齒，始也，少長之別始乎此也，以齒食多者長也，食少者幼也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (324, '牙', '䶥', '牙，有樝[䶥]牙也，隨形言之也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (325, '頤', '宧', '頤，[宧，]養也，動於下、止於上，上下咀物以養人也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (326, '輔車', '', '頤，一曰輔車，言其骨强，所以輔持口也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (327, '牙車', '', '頤，一曰牙車，牙所載也；', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (328, '頷車', '含', '頤，一曰頷車，頷，含也，口含物之車也；', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (329, '頰車', '', '頤，一曰頰車，亦所以載物也；', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (330, '鼸車', '', '頤，一曰鼸車，鼸鼠之食積於頰，人食似之，故取名也。凡繫於車，皆取在下載上物也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (331, '耳', '而', '耳，耏[而]也，耳有一體，屬著兩邊，耏耏然也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (332, '脣', '緣', '脣，緣也，口之緣也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (333, '吻', '免捪', '吻，免也，入之則碎，出則免也。又取抆[捪]也，漱唾所出，恆加抆拭。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (334, '口卷', '', '吻曰口卷，可以卷制食物使不落，因以爲名也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (335, '立人', '', '鼻下曰立人，取立於鼻下，狹而長，似人立也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (336, '髭', '姿', '口上曰髭，髭，姿也，爲姿容之美也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (337, '承𤖅', '', '口下曰承𤖅，承水𤖅也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (338, '須', '秀', '頤下曰須，須，秀也，物成乃秀，人成而須生也。亦取須體幹長而後生也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (339, '髯', '冉', '在頰耳旁曰髯，隨口動搖，髯髯[冉冉]然也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (340, '鬢', '濱', '頰上連髪曰鬢。鬢，濱也；濱，崖也，爲面額之崖岸也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (341, '距', '巨', '鬢曲頭曰距。距，矩[巨]也，言其曲似矩也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (342, '項', '确', '項，确也，堅确受枕之處也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (343, '頸', '徑', '頸，徑也，徑挺而長也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (344, '咽', '', '咽，所以咽物也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (345, '嬰', '纓', '咽曰嬰，在頤下纓理之中也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (346, '脰', '投', '咽，靑徐謂之脰，物投其中，受而下之也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (347, '嗌', '阸', '咽，靑徐謂之嗌，氣所流通，阨[阸]要之處也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (348, '胡', '互', '胡，互也，在咽下垂，能歛互物也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (349, '匈', '空', '胸猶啌，啌[空]，啌氣所衝也。', '釋形體第八', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (350, '肊', '抑', '臆猶抑，抑氣所塞也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (351, '膺', '邕', '膺，壅[邕]也，氣所壅塞也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (352, '腹', '複富', '腹，複也、富也，腸胃之屬以自裹盛，復於外複之，其中多品，似富者也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (353, '心', '纖', '心，纖也，所識纖微，無物不貫也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (354, '肝', '幹', '肝，幹也，於五行屬木，故其體狀有枝幹也。凡物以木爲幹也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (355, '肺', '孛', '肺，勃[孛]也，言其氣勃鬱也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (356, '脾', '裨', '脾，裨也，在胃下，裨助胃氣，主化穀也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (357, '腎', '引', '腎，引也。腎屬水，主引水氣，灌注諸脈也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (358, '胃', '圍', '胃，圍也，圍受食物也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (359, '腸', '𧀄', '腸，暢[𧀄]也，通暢胃氣，去滓穢也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (360, '臍', '劑', '臍，劑也，腸端之所限劑也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (361, '水腹', '', '自臍以下曰水腹，水汋所聚也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (362, '少腹', '小', '水腹，一曰少腹，少，小也，比於臍以上爲小也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (363, '脬', '鞄', '脬，鞄也。鞄，空虛之言也，主以虛承水汋也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (364, '旁光', '橫廣', '脬，一曰膀胱，言其體短而橫廣也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (365, '陰', '蔭', '陰，蔭也，言所在蔭翳也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (366, '脇', '挾', '脇，挾也，在兩旁，臂所挾也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (367, '肋', '勒', '肋，勒也，所以檢勒五臧也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (368, '膈', '隔', '膈，隔也，隔塞上下，使氣與穀不相亂也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (369, '亦', '繹', '腋，繹也，言可張翕尋繹也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (370, '肩甲', '堅闔', '髆曰肩甲。肩，堅也。甲，闔也，與胸脅背相會闔也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (371, '臂', '裨', '臂，裨也，在旁曰裨也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (372, '肘', '注', '肘，注也，可隠注也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (373, '𢯲', '宛', '腕，宛也，言可宛屈也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (374, '掌', '', '掌，言可以排掌也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (375, '手', '䇓', '手，須[䇓]也，事業之所須也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (376, '節', '', '節，有限節也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (377, '爪', '紹', '爪，紹也，筋極爲爪，紹續指端也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (378, '背', '倍', '背，倍也，在後稱也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (379, '脊', '積', '脊，積也，積續骨節，終上下也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (380, '尾', '𢼸', '尾，微[𢼸]也，承脊之末，稍微殺也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (381, '要', '約', '要，約也，在體之中，約結而小也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (382, '髖', '緩', '髖，緩也，其腋皮厚而緩也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (383, '𡱂', '', '臀，殿也，高厚有殿鄂[殿遻]也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (384, '尻', '廫', '尻，廖[廫]也，所在廖牢深也。', '釋形體第八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (385, '樞', '', '樞，機也，要脾股動搖如樞機也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (386, '髀', '卑', '髀，卑也，在下稱也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (387, '股', '固', '股，固也，爲强固也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (388, '膝', '伸', '膝，伸也，可屈伸也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (389, '腳', '卻', '腳，卻也，以其坐時卻在後也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (390, '脛', '莖', '脛，莖也，直而長似物莖也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (391, '欂', '團', '膝頭曰膞。膞，團也，因形團而名之也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (392, '枅', '扁', '膝頭曰蹁。蹁，扁也，亦因形而名之。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (393, '足', '續', '足，續也，言續脛也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (394, '止', '', '趾，止也，言行一進一止也。', '釋形體第八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (395, '蹏', '底', '蹏，底也，在足底也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (396, '踝', '确', '踝，确也，居足兩旁，磽确然也，亦因其形踝踝然也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (397, '跟', '根', '足後曰跟，在下方著地，一體任之，象木根也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (398, '踵', '鍾', '足后曰踵。踵，鍾也，鍾聚也，上體之所鍾聚也。', '釋形體第八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (399, '姿', '資', '姿，資也。資，取也，形貌之稟，取爲資本也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (400, '容', '用', '容，用也，合事宜之用也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (401, '妍', '研', '妍，研也，研精於事宜，則無蚩繆也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (402, '蚩', '癡', '蚩，癡也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (403, '行', '抗', '兩腳進曰行。行，抗也，抗足而前也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (404, '步', '捕', '徐行曰步。步，捕也，如有所伺捕，務安詳也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (405, '趨', '赴', '疾行曰趨。趨，赴也，赴所期也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (406, '走', '奏', '疾趨曰走。走，奏也，促有所奏至也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (407, '奔', '變', '疾走曰奔。奔，變也，有急變，奔赴之也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (408, '仆', '踣', '仆，踣也，頓踣而前也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (409, '超', '趠', '超，卓[趠]也，舉腳有所卓越也。', '釋姿容第九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (410, '跳', '條', '跳，條也，如草木枝條，務上行也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (411, '立', '林', '立，林也，如林木森然，各駐其所也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (412, '騎', '枝', '騎，枝也，兩腳枝別也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (413, '乘登', '', '乘，陞也，登亦如之也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (414, '載', '戴', '載，戴也，戴在其上也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (415, '儋', '任', '儋，任也，任力所勝也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (416, '負', '背', '負，背也，置項背也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (417, '駐', '株', '駐，株也，如株木不動也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (418, '坐', '挫', '坐，挫也，骨節挫屈也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (419, '伏', '覆', '伏，覆也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (420, '妟', '安', '偃，安也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (421, '僵', '', '僵，正直畺然也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (422, '側', '', '側，偪也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (423, '據', '居', '據，居也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (424, '企', '啟', '企，啟也。啟，開也，言自延竦之時，樞機皆開張也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (425, '竦', '從', '竦，從也，體支皆從引也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (426, '視', '是', '視，是也，察其是非也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (427, '聽', '靜', '聽，靜也，靜，然後所聞審也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (428, '觀', '厂', '觀，翰[厂]也，望之延頸翰翰也。', '釋姿容第九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (429, '望', '亡', '望，茫[亡]也，遠視茫茫也。', '釋姿容第九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (430, '跪', '危', '跪，危也，兩膝隠地，體危陧也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (431, '跽', '忌', '跽，忌也，見所敬忌，不敢自安也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (432, '跌', '', '拜，於丈夫爲跌，跌然屈折，下就地也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (433, '扶', '', '拜，於婦人爲扶，自抽扶而上下也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (434, '𡴂', '翻', '攀，翻也，連翻上及之言也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (435, '𤸪', '制', '掣，制也，制頓之使順己也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (436, '牽', '弦', '牽，弦也，使弦急也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (437, '引', '演', '引，演也，使演廣也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (438, '匊', '局', '掬，局也，使相局近也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (439, '撮', '捽', '撮，捽也，擊捽取之也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (440, '抯', '叉', '摣，叉也，五指俱往叉取也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (441, '捉', '促', '捉，促也，使相促及也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (442, '執', '懾', '執，攝[懾]也，使畏攝己也。', '釋姿容第九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (443, '拈', '黏', '拈，黏也，兩指翕之，黏著不放也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (444, '抶', '鐵', '抶，鐵也，其處皮薰黑，色如鐵也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (445, '蹋', '', '蹋，榻也，榻著地也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (446, '捭', '裨', '捭，裨也，兩指裨助，共擊之也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (447, '挾', '夾', '挾，夾也，夾在旁也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (448, '捧', '逢', '捧，逢也，兩手相逢以執之也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (449, '懷', '回歸', '懷，回也，本有去意，回來就己也。亦言歸也，來歸己也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (450, '袌', '保', '抱，保也，相親保也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (451, '戴', '載', '戴，載也，載之於頭也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (452, '提', '地', '提，地也，臂垂所持近地也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (453, '挈', '結', '挈，結也，結束持之也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (454, '持', '偫', '持，跱[偫]也，跱之於手中也。', '釋姿容第九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (455, '操', '鈔', '操，鈔也，手出其下之言也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (456, '攬', '斂', '攬，斂也，斂置手中也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (457, '𢹬', '巩', '擁，翁[巩]也，翁撫之也。', '釋姿容第九', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (458, '撫', '尃', '撫，敷[尃]也，敷手以拍之也。', '釋姿容第九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (459, '𢫦', '搏', '拍，搏也，以手搏其上也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (460, '搏', '博', '搏，博也，四指廣博，亦以擊之也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (461, '摩娑', '末殺', '摩娑，猶末殺也，手上下之言也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (462, '蹴', '逎', '蹙，遒[逎]也，遒迫之也。', '釋姿容第九', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (463, '踐', '殘', '踐，殘也，使殘壊也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (464, '踖', '藉', '踖，藉也，以足藉也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (465, '履', '', '履，以足履之，因以名之也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (466, '蹈', '道', '蹈，道也，以足踐之，如道路也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (467, '跐', '', '跐，弭也，足踐之，使弭服也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (468, '𤴘', '懾', '躡，攝也，登其上使攝[懾]服也。', '釋姿容第九', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (469, '匍匐', '捕伏', '匍匐，小兒時也。匍猶捕也，藉索可執取之言也；匐，伏也，伏地行也。人雖長大，及其求事，盡力之勤，猶亦稱之。詩曰「凡民有喪，匍匐救之」是也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (470, '㫃蹇', '', '偃蹇，偃，偃息而臥，不執事也。蹇，跛蹇，病不能作事，今託病似此也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (471, '望羊', '陽', '望羊，羊，陽也，言陽氣在上，舉頭高，似若望之然也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (472, '沐秃', '', '沐秃，沐者髪下垂，秃者無髪，皆無上貌之稱也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (473, '卦賣', '挂', '卦賣，卦，挂也，自挂於市而自賣邊，自可無慙色，言此似之也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (474, '倚籭', '技', '倚簁，倚，技也；簁，作清簁也。言人多技巧，尙輕細如簁也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (475, '寠數', '局縮', '寠數猶局縮，皆小意也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (476, '齧𤸪', '', '齧掣，掣，卷掣也；齧，噬齧也。語說卷掣，與人相持，如噬齧也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (477, '衇謫', '', '衇摘猶言譎摘，如醫別人衇，知疾之意，見事者之稱也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (478, '貸𥏳', '', '貸騃，貸者，言以物貸予。騃者，言必棄之不復得也。不相量事者之稱也。此皆見於形貌者也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (479, '臥', '𠤎', '臥，化[𠤎]也，精氣變化，不與覺時同也。', '釋姿容第九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (480, '寐', '謐', '寐，謐也，靜謐無聲也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (481, '寢', '侵', '寢，權假臥之名也。寢，侵也，侵損事功也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (482, '瞑', '冥', '眠，泯[冥]也，無知泯泯也。', '釋姿容第九', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (483, '覺', '告', '覺，告也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (484, '寤', '啎', '寤，忤[啎]也，能與物相接忤也。', '釋姿容第九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (485, '欠', '欽', '欠，欽也，開張其口作聲，脣欽欽然也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (486, '嚏', '', '嚏，疐也，聲作疐而出也。', '釋姿容第九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (487, '𥬇', '鈔', '笑，鈔也，頰皮上鈔者也。', '釋姿容第九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (488, '嬰兒', '', '人始生曰嬰兒，胸前曰嬰，抱之嬰前，乳養之也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (489, '嫛婗', '是', '嬰兒，一曰嫛婗，嫛，是也，言是人也。婗，其啼聲也，故因以名之也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (490, '男', '任', '男，任也，典任事也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (491, '女', '如', '女，如也，婦人外成，如人也，故三從之義，少如父教，嫁如夫命，老如子言。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (492, '吾', '啎', '女，靑徐人曰娪，娪，忤[啎]也，始生時，人意不喜，忤忤然也。', '釋長幼第十', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (493, '孺', '濡', '兒始能行曰孺子。孺，濡也，言濡弱也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (494, '悼', '逃', '七年曰悼。悼，逃也，知有廉恥，隠逃其情也。亦言是時而死，可傷悼也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (495, '齔', '洗', '毀齒曰齔。齔，洗也，毁洗故齒，更生新也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (496, '長', '', '長，萇也，言體萇也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (497, '幼', '少', '幼，少也，言生日少也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (498, '童笄', '', '十五曰童，故禮有「陽童」，牛羊之無角者曰童，山無草木亦曰童，言未巾冠似之也。女子之未笄者亦稱童也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (499, '弱', '', '二十曰弱，言柔弱也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (500, '壯', '', '三十曰壯，言丁壯也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (501, '强', '', '四十曰强，言堅强也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (502, '艾', '', '五十曰艾。艾，乂也。乂，治也，治事能斷割芟乂，無所疑也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (503, '耆', '指', '六十曰耆。耆，指也，不從力役，指事使人也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (504, '耄', '', '七十曰耄，頭髪白，耄耄然也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (505, '耋', '鐵', '八十曰耋，耋，鐵也，皮膚變黑，色如鐵也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (506, '鮐背', '', '九十曰鮐背，背有鮐文也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (507, '黃耇', '垢', '九十曰黃耇。黃，鬢髪變黃也；耇，垢也，皮色驪顇，恆如有垢者也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (508, '胡耇', '', '九十曰胡耇，咽皮如雞胡也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (509, '凍棃', '', '九十曰凍棃，皮有斑點，如凍棃色也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (510, '齯齒', '兒', '九十曰齯齒，大齒落盡，更生細者如小兒齒也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (511, '期頤', '宧', '百年曰期頤。頤[宧]，養也，老昏不復知服味善惡，孝子期於盡養道而巳也。', '釋長幼第十', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (512, '老', '', '老，朽也。', '釋長幼第十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (513, '僊', '仙遷', '老而不死曰仙，仙，遷也，遷入山也，故其制字人旁作山也。', '釋長幼第十', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (514, '𧡿', '櫬', '親，襯也，言相隱襯[𤔌櫬]也。', '釋親屬第十一', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (515, '屬', '續', '屬，續也，恩相連續也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (516, '父', '甫', '父，甫也，甫，始也，始生己也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (517, '母', '冒', '母，冒也，冒，含也，含生己也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (518, '祖', '胙', '祖，祚[胙]也，祚，物先也。', '釋親屬第十一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (519, '王父王母', '往', '祖，一曰王父、王母，王，暀[往]也，家中所歸暀也。', '釋親屬第十一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (520, '曾祖曾孫', '增', '曾祖，從下推上，祖位轉增益也。曾孫亦如之。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (521, '高祖', '皋', '高祖，高，皋也，最在上，皋韜諸下也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (522, '兄', '荒', '兄，荒也；荒，大也，故靑徐人謂兄爲荒也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (523, '弟', '', '弟，第也，相次第而生也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (524, '子', '孳', '子，孳也，相生蕃孳也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (525, '孫', '遜', '孫，遜也，遜遁在後生也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (526, '玄孫', '縣', '玄孫，玄，縣也，上縣於高祖，最在下也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (527, '來孫', '', '玄孫之子曰來孫，此在無服之外，其意疏遠，呼之乃來也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (528, '𥊽孫', '貫', '來孫之子曰昆孫。昆，貫也，恩情轉遠，以禮貫連之耳。', '釋親屬第十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (529, '仍孫', '', '昆孫之子曰仍孫，以禮仍有之耳，恩意實遠也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (530, '雲孫', '', '仍孫之子曰雲孫，言去己遠，如浮雲也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (531, '世父', '', '父之兄曰世父，言爲嫡統繼世也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (532, '伯父', '把', '世父，一曰伯父，伯，把也，把持家政也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (533, '仲父', '中', '父之弟曰仲父。仲，中也，位在中也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (534, '叔父', '少', '仲父之弟曰叔父，叔，少也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (535, '季父', '癸', '叔父之弟曰季父。季，癸也。甲乙之次，癸最在下，季亦然也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (536, '從祖父母', '', '父之世叔父母曰從祖父母，言從己親祖別而下也。亦言隨從己祖以爲名也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (537, '姑', '故', '父之姊妹曰姑。夫之母亦曰姑。姑，故也，言於己爲久故之人也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (538, '姊', '積', '姊，積也，猶日始岀，積時多而明也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (539, '妹', '昧', '妹，昧也，猶日始出，歷時少，尙昧也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (540, '姪', '迭', '姑謂兄弟之女爲姪。姪，迭也，共行事夫，更迭進御也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (541, '舅', '久', '夫之父曰舅。母之兄弟亦曰舅。舅，久也，久老稱也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (542, '外舅外姑', '', '妻之父曰外舅，母曰外姑，言妻從外來，至己家爲婦，故反以此稱之，夫妻匹敵之義也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (543, '外甥', '生', '妻之𥊽弟曰外甥，其姊妹女也，來歸己，內爲妻，故其男爲外姓之甥。甥，生也，他姓子，本生於外，不得如其女來在己內也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (544, '出', '', '姊妹之子曰出，出嫁於異姓而生之也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (545, '離孫', '', '岀之子曰離孫，言遠離己也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (546, '歸孫', '', '姪之子曰歸孫。婦人謂嫁曰歸，姪子列，故其所生爲孫也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (547, '姨從母', '弟娣', '妻之姊妹曰姨，姨，弟也，言與己妻相長弟也。母之姊妹曰姨，亦如之。禮謂之從母，爲娣而來，則從母列也。故雖不來，猶以此名之也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (548, '厶', '', '姊妹互相謂夫曰私，言於其夫兄弟之中，此人與己姊妹有恩私也。', '釋親屬第十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (549, '甥', '生', '姊妹互相謂子曰甥，甥亦生也，出配他男而生，故其制字男旁作生也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (550, '女君男君', '', '妾謂夫之嫡妻曰女君。夫爲男君，故名其妻曰女君也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (551, '㛮', '叜縮', '嫂，叟[叜]也，老者稱也；叟，縮也，人及物老，皆縮小於舊也。', '釋親屬第十一', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (552, '叔', '少倏', '叔，少也，幼者稱也。亦言俶[倏]也，見嫂俶然卻退也。', '釋親屬第十一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (553, '兄公', '君', '夫之兄曰兄公。公，君也；君，尊稱也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (554, '兄章', '灼', '夫之兄，俗閒曰兄章。章，灼也，章灼、敬奉之也。俗或謂舅曰章，亦如之也。', '釋親屬第十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (555, '兄伀', '', '夫之兄，一曰兄伀，言是己所敬，見之怔忪，自肅齊也。俗或謂舅曰忪，亦如之也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (556, '姒', '似', '少婦謂長婦曰姒，言其先來，己所當法似也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (557, '娣', '弟', '長婦謂少婦曰娣。娣，第[弟]也，次第己後來也。或曰先後，以來先後言之也。', '釋親屬第十一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (558, '稙', '', '靑徐人謂長婦曰稙，禾苗先生者曰稙，取名於此也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (559, '孰', '柷', '荆豫人謂長婦曰熟，熟，祝[柷]也；祝，始也。', '釋親屬第十一', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (560, '亞', '', '兩壻相謂曰亞，言一人取姊，一人取妹，相亞次也。又並來至女氏門，姊夫在前，妹夫在後，亦相亞也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (561, '友壻', '', '兩壻相謂曰友壻，言相親友也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (562, '婚', '昏', '婦之父曰婚，言壻親迎用昏，女恆以昏夜成禮也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (563, '姻', '因', '壻之父曰姻。姻，因也，女往因媒也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (564, '后', '後', '天子之妃曰后。后，後也，言在後，不敢以副言也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (565, '夫人', '扶', '諸侯之妃曰夫人。夫，扶也，扶助其君也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (566, '內子', '', '卿之妃曰內子。子，女子也，在閨門之內治家也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (567, '命婦', '服', '大夫之妃曰命婦。婦，服也，服家事也。夫受命於朝，妻受命於家也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (568, '妻', '齊', '士、庶人曰妻。妻，齊也。夫賤不足以尊稱，故齊等言也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (569, '嬪', '賓', '天子妾有嬪。嬪，賓也，諸妾之中見賓敬也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (570, '妾', '接', '妾，接也，以賤見接幸也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (571, '𠈪', '承', '姪娣曰𡟒，𡟒，承也，承事嫡也。', '釋親屬第十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (572, '妃', '輩', '妃，輩也，一人獨處，一人往輩耦之也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (573, '匹', '僻', '匹，辟[僻]也，往相辟耦也。', '釋親屬第十一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (574, '耦', '遇', '耦，遇也，二人相對遇也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (575, '嫡', '敵', '嫡，敵也，與匹相敵也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (576, '庶', '拓', '庶，摭[拓]也，拾摭之也。謂拾摭微陋，待遇之也。', '釋親屬第十一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (577, '矝', '煇', '無妻曰鰥。鰥，昆[煇]也；昆，明也。愁悒不寐，目恆鰥鰥然也，故其字從魚，魚目恆不閉者也。', '釋親屬第十一', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (578, '寡', '顆', '無夫曰寡。寡，踝[顆]也。踝踝，單獨之言也。', '釋親屬第十一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (579, '孤', '顧', '無父曰孤。孤，顧也，顧望無所瞻見也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (580, '獨', '', '老而無子曰獨。獨，隻獨也，言無所依也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (581, '嬖', '卑', '嬖嬖，卑賤婢妾，媚以色事人得幸者也。', '釋親屬第十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (582, '道', '導', '道，導也，所以通導萬物也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (583, '悳', '得', '德，得也，得事宜也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (584, '文', '彣', '文，彣也，會集衆綵以成錦繍，會集衆字以成辭義，如彣繍然也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (585, '武', '舞', '武，舞也，征伐動行，如物鼓舞也。故樂記曰：「發揚蹈厲，太公之志也。」。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (586, '仁', '忍', '仁，忍也，好生惡殺，善含忍也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (587, '誼', '宜', '誼，宜也，裁制事物，使合宜也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (588, '禮', '體', '禮，體也，得事體也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (589, '𥏼', '知', '智，知也，無所不知也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (590, '信', '申', '信，申也，言以相申束，使不相違也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (591, '孝', '好', '孝，好也，愛好父母，如所說好也。孝經說曰：「孝，畜也，畜養也。」。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (592, '慈', '字', '慈，字也，字，愛物也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (593, '友', '有', '友，有也，相保有也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (594, '恭', '拱供', '恭，拱也，自拱持也。亦言供給事人也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (595, '悌', '弟', '悌，弟也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (596, '敬', '警', '敬，警也，恆自肅警也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (597, '慢', '曼', '慢，漫[曼]也，漫漫，心無所限忌也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (598, '通', '迵', '通，洞[迵]也，無所不貫洞也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (599, '達', '徹', '達，徹也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (600, '敏', '潣', '敏，閔[潣]也，進取無否滯之言也。故汝潁言敏如閔也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (601, '䈞', '築', '篤，築也，築，堅實稱也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (602, '㫗', '後', '厚，後也，有終後也。故靑徐人言厚如後也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (603, '洦', '迫', '薄，迫也，單薄相偪迫也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (604, '懿', '𥴨', '懿，僾[𥴨]也，言奥僾也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (605, '良', '量', '良，量也，量力而動，不敢越限也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (606, '言', '宣', '言，宣也，宣彼此之意也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (607, '語', '敘', '語，敘也，敘己所欲說也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (608, '說', '述', '說，述也，宣述人意也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (609, '序', '抒', '序，抒也，抴抒其實也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (610, '抴', '渫', '抴，泄[渫]也，發泄出之也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (611, '發', '撥播', '發，撥也，撥使開也。亦言播也，播使移散也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (612, '導', '匋', '導，陶[匋]也，陶演己意也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (613, '演', '延', '演，延也，言蔓延而廣也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (614, '頌', '容', '頌，容也，敘說其成功之形容也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (615, '贊', '慮', '讚，録[慮]也，省録之也。', '釋言語第十二', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (616, '名', '', '銘，名也，記名其功也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (617, '革', '刻', '勒，刻也，刻識之也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (618, '紀', '記', '紀，記也，記識之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (619, '識', '幟是', '識，幟也，有章幟可按視也。亦言是也，察其是非也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (620, '是', '嗜', '是，嗜也，人嗜樂之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (621, '非', '排', '非，排也，人所惡，排去也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (622, '基', '據', '基，據也，在下，物所依據也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (623, '業', '捷', '業，捷也，事捷乃有功業也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (624, '事', '敕', '事，倳[敕]也；倳，立也，凡所立之功也。故靑徐人言立曰倳也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (625, '功', '攻', '功，攻也，攻治之乃成也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (626, '取', '趣', '取，趣也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (627, '名', '朙', '名，明[朙]也，名實事使分明也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (628, '號', '呼', '號，呼也，以其善惡呼名之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (629, '善', '演', '善，演也，演盡物理也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (630, '惡', '㧖', '惡，㧖也，㧖困物也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (631, '好', '巧', '好，巧也，如巧者之造物，無不皆善，人好之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (632, '醜', '殠', '醜，臭[殠]也，如臭穢也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (633, '遟', '隤', '遟，頽[隤]也，不進之言也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (634, '疾', '𢧵', '疾，𢧵也，有所越𢧵也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (635, '緩', '刓', '緩，浣[刓]也。浣，斷也，持之不急，則動搖浣斷，自放縱也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (636, '急', '及', '急，及也，操切之，使相逮及也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (637, '巧', '攷', '巧，攷也，攷合異類，共成一體也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (638, '拙', '詘', '拙，屈[詘]也，使物否屈不爲用也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (639, '燥', '焦', '燥，焦也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (640, '溼', '浥', '溼，浥也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (641, '彊', '僵', '彊，畺[僵]也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (642, '弱', '衄', '弱，衂[衄]也，言委衂也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (643, '能', '晐', '能，該[晐]也，無物不兼該也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (644, '否', '啚', '否，鄙[啚]也，鄙劣不能有所堪成也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (645, '喿', '燥', '躁，燥也，物燥乃動而飛揚也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (646, '靜', '整', '靜，整也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (647, '屰', '遻', '逆，遻也。言不從其理，則生殿遻不順也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (648, '順', '循', '順，循也，循其理也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (649, '淸', '靑', '淸，靑也，去濁遠穢，色如靑也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (650, '濁', '瀆', '濁，瀆也，汁滓演瀆也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (651, '貴', '歸', '貴，歸也，物所歸仰也。汝潁言貴，聲如「歸暀」之歸也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (652, '賤', '踐', '賤，踐也，卑下見踐履也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (653, '榮', '熒', '榮猶熒熒，照明貌也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (654, '辱', '衄', '辱，亦衂[衄]也，言折衂也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (655, '禍', '毀', '禍，毀也，言毀滅也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (656, '福', '富', '福，富也，其中多品，如富者也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (657, '進', '引', '進，引也，引而前也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (658, '退', '隊', '退，墜[隊]也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (659, '羸', '絫', '羸，累[絫]也，恆累於人也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (660, '健', '建', '健，建也，能有所建爲也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (661, '哀', '㤅', '哀，愛[㤅]也，愛乃思念之也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (662, '樂', '', '樂，樂也，使人好樂之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (663, '委', '', '委，萎也，萎蕤就之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (664, '曲', '局', '曲，局也，相局近也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (665, '蹤', '從', '蹤，從也，人形從之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (666, '迹', '積', '跡，積也，積累而前也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (667, '扶', '搏', '扶，傅[搏]也，傅近之也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (668, '𢪇', '', '將，將救護之也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (669, '縛', '薄', '縛，薄也，使相薄著也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (670, '束', '促', '束，促也，相促近也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (671, '覆', '孚', '覆，孚也，如孚甲之在物外也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (672, '盇', '加', '葢，加也，加物上也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (673, '威', '畏', '威，畏也，可畏懼也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (674, '嚴', '儼', '嚴，儼也，儼然人憚之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (675, '政', '正', '政，正也，下所取正也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (676, '教', '效', '教，效也，下所法效也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (677, '侍', '時', '侍，時也，尊者不言，常於時供所當進者也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (678, '御', '語', '御，語也，尊者將有所欲，先語之也。亦言職卑，尊者所勒御，如御牛馬然也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (679, '雅', '雒', '雅，雒也，爲之難，人將爲之，雒雒然憚之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (680, '俗', '欲', '俗，欲也，俗人所欲也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (681, '艱', '根', '艱，根也，如物根也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (682, '難', '憚', '難，憚也，人所忌憚也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (683, '吉', '實', '吉，實也，有善實也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (684, '凶', '空', '凶，空也，就空亡也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (685, '亭', '定', '停，定也，定於所在也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (686, '起', '企', '起，啟[企]也，啟舉一體也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (687, '翱', '敖', '翱，敖也，言敖遊也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (688, '翔', '', '翔，佯也，言仿佯[旁央]也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (689, '出', '推', '出，推也，推而前也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (690, '入', '內', '入，內也，內使還也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (691, '候', '護', '候，護也，司護諸事也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (692, '望', '亡', '望，惘[亡]也，視遠惘惘也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (693, '佼', '交', '狡，交也，與物交錯也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (694, '夬', '決', '夬，決也，有所破壊決裂也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (695, '終', '充', '終，充也，充之於始也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (696, '始', '息', '始，息也，言滋息也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (697, '消', '削', '消，削也，言減削也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (698, '息', '塞', '息，塞也，言物滋息塞滿也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (699, '姦', '奸', '姦，奸也，言奸正法也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (700, '宄', '恑', '宄，佹[恑]也，佹易常正也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (701, '誰', '推', '誰，推也，有推擇，言不能一也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (702, '往', '卬', '往，暀也，歸暀於彼也，故其言之，卬頭以指遠也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (703, '來', '依', '來，哀[依]也，使來入己哀之，故其言之，低頭以招之也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (704, '麤', '逪', '麤，錯[逪]也，相遠之言也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (705, '細', '佴', '細，弭[佴]也，弭弭兩致之言也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (706, '疏', '索', '疏，索也，獲索相遠也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (707, '甘', '含', '甘，含也，人所含也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (708, '苦', '吐', '苦，吐也，人所吐也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (709, '安', '妟', '安，晏[妟]也，晏晏然和喜，無動懼也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (710, '危', '𦨉', '危，阢[𦨉]也。阢阢，不固之言也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (711, '成', '', '成，盛也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (712, '敗', '潰', '敗，潰也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (713, '亂', '溷', '亂，渾[溷]也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (714, '治', '值', '治，值也，物皆值其所也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (715, '煩', '䋣', '煩，繁[䋣]也，物繁則相雜撓也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (716, '省', '', '省，𤸃也，臞𤸃約少之言也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (717, '閒', '𥳑', '閒，𥳑也，事功𥳑省也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (718, '勮', '鉅', '劇，巨[鉅]也，事功巨也。', '釋言語第十二', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (719, '貞', '定', '貞，定也，精定不動惑也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (720, '淫', '浸', '淫，浸也，浸淫旁人之言也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (721, '湛', '淡', '沈，澹[淡]也，澹然安著之言也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (722, '浮', '孚', '浮，孚也，孚甲在上稱也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (723, '貪', '探', '貪，探也，探取入他分也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (724, '廉', '斂', '廉，斂也，自檢斂[儉斂]也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (725, '絜', '隺', '潔，確[隺]也，確然不羣貌也。', '釋言語第十二', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (726, '汙', '洿', '污，洿也，如洿泥也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (727, '公', '廣', '公，廣也，可廣施也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (728, '厶', '恤', '私，恤也，所恤念也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (729, '勇', '踊', '勇，踴[踊]也，遇敵踴躍，欲擊之也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (730, '怯', '脅', '怯，脅也，見敵恐脅也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (731, '斷', '𥠄', '斷，段[𥠄]也，分爲異段也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (732, '絕', '𢧵', '絕，𢧵也，如割𢧵也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (733, '罵', '迫', '罵，迫也，以惡言被迫人也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (734, '詈', '歷離', '詈，歷也，以惡言相彌歷也。亦言離也，以此挂離之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (735, '祝', '屬', '祝，屬也，以善惡之詞相屬著也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (736, '詛', '阻', '詛，阻也，使人行事阻限於言也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (737, '𥁰', '朙', '盟，明[朙]也，告其事於神明也。', '釋言語第十二', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (738, '誓', '制', '誓，制也，以拘制之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (739, '左', '𠂇', '佐，左[𠂇]也，在左右也。', '釋言語第十二', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (740, '助', '乍', '助，乍也，乍往相助，非長久也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (741, '飾', '弋', '飾，拭[弋]也，物穢者，拭其上使明。由他物而後明，猶加文於質上也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (742, '踼', '盪', '蕩，盪也，排盪去穢垢也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (743, '咄', '惙', '咄，惙也，心有所念，惙然發此聲也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (744, '嗟', '左', '嗟，佐[左]也，言之不足以盡意，故發此聲以自佐也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (745, '噫', '意', '噫，憶[意]也，憶念之，故發此聲也。', '釋言語第十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (746, '烏', '舒', '嗚，舒也，氣憤懣，故發此聲以舒寫之也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (747, '念', '黏', '念，黏也，意相親愛，心黏著不能忘也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (748, '意', '', '憶，意也，恆在意中也。', '釋言語第十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (749, '思忖', '司', '思，司也，凡有所司捕，必靜思。忖亦然也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (750, '克', '刻', '克，刻也。刻物有定處，人所克念，有常心也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (751, '慮', '旅', '慮，旅也；旅，衆也。易曰：「一致百慮」。慮及衆物，以一定之也。', '釋言語第十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (752, '飲', '奄', '飲，奄也，以口奄而引咽之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (753, '食', '蒔', '食，殖[蒔]也，所以自生殖也。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (754, '啜', '絕', '啜，絕也，乍啜而絶於口也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (755, '餐', '乾', '餐，乾也，乾入口也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (756, '吮', '循', '吮，循也，不絕口，稍引滋汋，循咽而下也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (757, '欶', '促', '嗽，促也，用口急促也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (758, '含銜', '合', '含，合也。合口停之也。銜亦然也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (759, '咀', '藉', '咀，藉也，以藉齒牙也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (760, '嚼', '削', '嚼，削也，稍削之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (761, '啄', '琢', '鳥曰啄，如琢物上復下也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (762, '齧', '齾', '獸曰囓。囓，齾也，所臨則秃齾也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (763, '餅', '并', '餅，并也，溲麫使合并也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (764, '胡餅', '杇', '胡餅作之，大漫污[槾杇]也。亦言以胡麻著上也。蒸餅、湯餅、蝎餅、髓餅、金餅、索餅之屬，皆隨形而名之也。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (765, '糝', '黏', '糝，黏也，相黏𪏮也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (766, '餌', '而', '餌，而也，相黏而也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (767, '鎕銻', '', '餌，兖、豫曰餹䬾，就形名之也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (768, '餈', '漬', '餈，漬也，烝燥屑，使相潤漬餅之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (769, '饙', '分', '饙，分也，衆粒各自分也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (770, '飧', '散', '飧，散也，投水於中解散也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (771, '𩱧', '朗', '羹，汪也，汁汪郎[暀朗]也。', '釋飲食第十三', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (772, '𦞦', '蒿', '𦞦，蒿也，香氣蒿蒿也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (773, '糜', '爢', '糜，煮米使糜[爢]爛也。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (774, '鬻', '濯', '粥，濯於糜，粥粥然也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (775, '𤖅', '𢪇', '𤖅，將[𢪇]也，飲之，寒溫多少與體相將順也。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (776, '湯', '', '湯，熱湯湯也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (777, '露', '澤', '酪，澤也，乳汁所作，使人肥澤也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (778, '䪢', '濟', '虀，濟也，與諸味相濟成也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (779, '菹', '阻', '菹，阻也，生釀之，遂使阻於寒温之閒，不得爛也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (780, '䤅', '投', '䤅，投也，味相投成也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (781, '醢', '晦', '醢，晦也，晦，冥也，封塗使密冥乃成也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (782, '䏙', '瀋', '醢多汁者曰𧖺。𧖺，瀋也，宋、魯人皆謂汁爲瀋。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (783, '腝', '昵', '醢有骨者曰臡，臡，昵也，骨肉相搏昵無汁也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (784, '𢻃', '旨', '豉，嗜[旨]也，五味調和，須之而成，乃可甘嗜也，故齊人謂豉、聲如嗜也。', '釋飲食第十三', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (785, '𥶶', '朽', '麴，朽也，鬱之使生衣朽敗也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (786, '糱', '缺', '糱，缺也，漬麥覆之，使生牙開缺也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (787, '鮺', '菹', '鮺，菹也，以鹽米釀魚以爲菹，熟而食之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (788, '昔', '', '腊，言乾昔也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (789, '脯', '搏', '脯，搏也，乾燥相搏著也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (790, '脩', '縮', '脯，一曰脩，脩，縮也，乾燥而縮也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (791, '膊', '迫', '膊，迫也，薄椓肉，迫著物使燥也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (792, '膾', '會', '膾，會也，細切肉，令散分其赤白異切之，巳乃會合和之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (793, '炙', '', '炙，炙也，炙於火上也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (794, '脯炙', '', '脯炙，以餳蜜豉汁淹而炙之，脯脯然也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (795, '釜炙', '', '釜炙，於釜汁中和熟之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (796, '䐄炙', '銜', '䐄炙，䐄，銜也。䐄炙，細切肉，和以薑、椒、鹽、豉，巳乃以肉銜，裹其表而炙之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (797, '貊炙', '', '貊炙，全體炙之，各自以刀割，出於胡貊之爲也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (798, '膾炙', '', '膾炙，細切豬、羊、馬肉，使如膾而炙之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (799, '生𦚺', '挻', '生脠，以一分膾，二分細切，合和挻攪之也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (800, '血䘓', '甚', '血䐄，以血作之，增有酢豉之味，使甚苦，以消酒也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (801, '膏饡', '', '膏饡，消膏而加菹其中，亦以消酒也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (802, '涗', '挩', '白瀹蔥薤曰兌，言其柔滑兌兌[挩]然也。', '釋飲食第十三', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (803, '韓羊韓兔韓雞', '', '韓羊、韓兔、韓雞，本法出韓國所爲也，猶酒言「宐成醪、蒼梧淸」之屬也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (804, '奥', '', '䐿，奥也，藏物於奥內，稍岀用之也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (805, '脬', '赴', '脬，赴也，夏月赴疾作之，久則臭也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (806, '分乾', '', '分乾，切豬肉以梧，分乾其中而和之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (807, '肺䐣', '饡', '肺䐣，䐣，饡也，以米糝之，如膏饡也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (808, '雞織', '瀸', '雞纖，細擗其腊，令纖[瀸]，然後漬以酢也。兔纖亦如之。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (809, '餳', '羕', '餳，洋也，煮米消爛，洋洋[羕]然也。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (810, '飴', '怡', '飴，小弱於餳，形怡怡然也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (811, '餔', '哺', '餔，哺也，如餳而濁，可哺也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (812, '酒', '酉踧', '酒，酉也，釀之米麴酉澤[繹]，久而味美也。亦言踧也，能否皆彊相踧，持飲之也。又入口咽之，皆踧其面也。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (813, '緹齊', '', '緹齊，色赤如緹也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (814, '盎齊', '滃', '盎齊，盎，滃也，滃滃然濁色也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (815, '汎齊', '', '汎齊，浮蟻在上，汎汎然也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (816, '沈齊', '', '沈齊，濁滓沈下，汁淸在上也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (817, '醴齊', '體', '醴齊，醴，體也，釀之一宿而成體，有酒味而巳也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (818, '繹酒', '', '醳酒，久釀酋繹也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (819, '事酒', '', '事酒，有事而釀之酒也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (820, '苦酒', '', '苦酒，淳毒甚者，酢苦也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (821, '寒粥', '', '寒粥，末稻米投寒水中，育育然也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (822, '乾飯', '', '干飯，飯而暴乾之也。', '釋飲食第十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (823, '糗', '𤘐', '糗，齲[𤘐]也，飯而磨散之，使齲碎也。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (824, '餱', '候', '餱，候也，候人飢者以食之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (825, '麮', '𤘐', '煮麥曰麮，麮亦齲[𤘐]也，煮熟亦齲壞也。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (826, '柰油', '', '柰油，搗柰實，和以塗繒上，燥而發之，形似油也。杏油亦如之。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (827, '桃濫', '', '桃濫，水漬而藏之，其味濫濫然酢也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (828, '柰脯', '', '柰脯，切柰暴乾之，如脯也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (829, '鮑魚', '腐', '鮑魚，鮑，腐也，埋藏奄之，使腐臭也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (830, '蟹胥', '湑', '蟹胥，取蟹藏之，使骨肉解，胥胥[湑]然也。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (831, '蟹虀', '', '蟹虀，去其匡齊[虀]，熟搗之，令如[加]虀也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (832, '桃諸', '儲', '桃諸，藏桃也。諸，儲也，藏以爲儲，待給冬月用之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (833, '瓠蓄', '', '瓠蓄，皮瓠以爲脯，蓄積以待冬月時用之也。', '釋飲食第十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (834, '黍', '𡫽', '黍，𪏮[𡫽]也，相黏𪏮也。', '釋飲食第十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (835, '靑', '生', '靑，生也，象物生時色也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (836, '赤', '赫', '赤，赫也，赫赫，太陽之色也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (837, '黃', '晃', '黃，猶晃晃，象日光色也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (838, '白', '', '白，白也；白，啓也，如冰啟時色也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (839, '黑', '晦', '黑，晦也，如晦冥時色也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (840, '絳', '工', '絳，工也，染之難得色，以得色爲工也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (841, '紫', '疵', '紫，疵也，非正色。五色之疵瑕，以惑人者也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (842, '紅', '絳', '紅，絳也。白色之似絳者也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (843, '相', '桑', '緗，桑也，如桑葉初生之色也。', '釋采帛第十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (844, '綠', '瀏', '綠，瀏也，荆泉之水，於上視之，瀏然綠色，此似之也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (845, '縹', '漂', '縹猶漂，漂漂淺靑色也。有碧縹，有天縹，有骨縹，各以其色所象言之也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (846, '緇', '滓', '緇，滓也。泥之黑者曰滓，此色然也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (847, '草', '早', '皁，早也，日未出時，早起視物皆黑，此色如之也。', '釋采帛第十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (848, '布', '', '布，布也，布列衆縷爲經，以緯橫成之也。又太古衣皮，女工之始始於是，施布其法，使民盡用之也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (849, '疏', '', '布亦謂之疏，言其經緯疏也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (850, '絹', '緊', '絹，䋗[緊]也，其絲䋗厚而疏也。', '釋采帛第十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (851, '縑', '兼', '縑，兼也，其絲細緻，數兼於絹。染兼五色，細緻不漏水也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (852, '練', '爤', '練，爛[爤]也，煮使委爛也。', '釋采帛第十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (853, '素', '', '素，言朴素也。巳織則供用，不復加功飾也。又物不加飾，皆目之爲素，此色然也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (854, '綈', '', '綈，似𧋘蟲之色，綠而澤也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (855, '錦', '金', '錦，金也，作之用功重，其價如金，故其制字從帛與金也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (856, '綺', '㩻', '綺，攲[㩻]也，其文攲邪，不順經緯之縱橫也。有杯文，形似杯也；有長命，其綵色相閒，皆橫終幅，此之謂也。言長命者，服之使人命長，本造者之意也。有棊文，方文如棊也。', '釋采帛第十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (857, '綾', '凌', '綾，凌也，其文望之如冰凌之理也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (858, '繡', '修', '繡，修也，文修修然也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (859, '笿', '', '羅，文羅[羅]疏也。', '釋采帛第十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (860, '籭', '', '纚，簁也，麤可以簁物也。', '釋采帛第十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (861, '笭辟', '', '笭辟，經絲貫杼中，一閒并、一閒疏，疏者笭笭然，并者歷辟而密也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (862, '疏', '', '紡麤絲織之曰疏。疏，料也，料料然疏也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (863, '縠', '粟踧', '縠，粟也，其形踧踧，視之如粟也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (864, '沙', '', '縠，又謂之沙，亦取踧踧如沙也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (865, '繐', '慧', '繐，慧也，齊人謂涼爲慧，言服之輕細涼慧也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (866, '紈', '渙', '紈，渙也，細澤有光，渙渙然也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (867, '蒸栗', '', '蒸栗，染紺使黃，色如蒸栗然也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (868, '紺', '含', '紺，含也，靑而含赤色也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (869, '綸', '侖', '綸，倫[侖]也，作之有倫理也。', '釋采帛第十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (870, '縵', '[面]', '綿猶湎[面]。湎，柔而無文也。', '釋采帛第十四', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (871, '絮', '胥', '絮，胥也，胥久能解落也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (872, '紬', '㩅', '紬，抽[㩅]也，抽引絲端岀細緒也。', '釋采帛第十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (873, '絓', '挂', '紬，又謂之絓，絓，挂也，挂於杖端，振舉之也。', '釋采帛第十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (874, '幕絡', '', '煮繭曰莫。莫，幕也，貧者著衣可以幕絡絮也。', '釋采帛第十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (875, '繫𦃇', '', '煮繭曰牽離，煮熟爛，牽引使離散如絮也。', '釋采帛第十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (876, '冠', '貫', '冠，貫也，所以貫韜[搯]髪也。', '釋首飾第十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (877, '纓', '頸', '纓，頸也，自上而繫於頸也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (878, '笄', '係', '笄，係也，所以係冠，使不墜也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (879, '冕', '俛文', '祭服曰冕。冕猶俛。俛，平直貌也。亦言文也，玄上纁下，前後垂珠，有文飾也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (880, '衮冕', '卷', '衮冕，衮，卷也，畫卷龍於衣也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (881, '鷩冕', '蔽', '鷩冕，鷩雉，山雞也。鷩，憋[蔽]也，性急憋，不可生服，必自殺，故畫其形於衣，以象人執耿介之節也。', '釋首飾第十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (882, '毳冕', '芮', '毳冕，毳，芮也，畫藻文於衣，象水草之毳芮，温暖而潔也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (883, '黹冕', '紩', '黹冕，黹，紩也，畫黻紩文采於衣也。此皆隨衣而名之也，所垂前後珠轉減耳。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (884, '章甫', '彰夫', '章甫，殷冠名也。甫，丈夫也，服之所以表章[彰]丈夫也。', '釋首飾第十五', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (885, '吁', '幠', '冔，殷冠名也。冔，幠也，幠之言覆，言以覆首也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (886, '牟追', '冒𠂤', '牟追，牟，冒也，言其形冒髪，追追[𠂤𠂤]然也。', '釋首飾第十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (887, '收', '', '收，夏后氏冠名也，言收斂髪也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (888, '委皃', '', '委貌，冠形有委曲之貌，上小下大也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (889, '㝸', '拚', '弁，如兩手相合抃[拚]時也。', '釋首飾第十五', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (890, '爵㝸皮㝸韋㝸', '', '以爵韋爲之，謂之爵弁；以鹿皮爲之，謂之皮弁；以韎韋爲之，謂之韋弁也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (891, '纚', '', '纚，以韜髪者也。以纚爲之，因以爲名也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (892, '總', '', '總，以束髪者也，總而束之也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (893, '幘', '迹', '幘，蹟[迹]也，下齊眉蹟然也。', '釋首飾第十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (894, '兌', '銳', '幘，或曰兌，上小下大，兌兌[銳]然也。', '釋首飾第十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (895, '夾', '', '幘，或曰𢂿，𢂿折其後也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (896, '兌幘', '', '幘，或曰兌幘，形似幘也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (897, '兌髪', '', '幘，賤者所著曰兌髪，作之裁裹髪也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (898, '牛心', '', '幘，或曰牛心，形似之也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (899, '冃', '冒', '帽，冒也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (900, '巾', '謹', '巾，謹也。二十成人，士冠，庶人巾，當自謹修於四敎也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (901, '兂', '兓', '簪，兓也，以兓連冠於髪也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (902, '擿', '', '揥，摘[擿]也，所以摘髪也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (903, '導', '', '導，所以導櫟鬢髪，使入巾幘之裏也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (904, '櫟鬢', '', '導，或曰櫟鬢，以事名之也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (905, '鏡', '景', '鏡，景也，言有光景也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (906, '梳', '疏', '梳，言其齒疏也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (907, '比', '', '梳，數者曰比，比於梳，其齒差數也。亦言細相比也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (908, '㕞', '帥瑟', '㕞，帥也。帥，髪長短皆令上從也。亦言瑟也，㕞髪令上瑟然也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (909, '籋', '攝', '鑷，攝也，攝取髪也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (910, '焦頭', '鈔', '綃頭，綃，鈔也，鈔髪使上從也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (911, '佰頭', '', '綃頭，或曰陌頭，言其從後橫陌而前也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (912, '裛', '掩', '綃頭，齊人謂之㡋，言㡋[掩]斂髪使上從也。', '釋首飾第十五', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (913, '副', '覆', '王后首飾曰副。副，覆也，以覆首也；亦言副貳也，兼用衆物，成其飾也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (914, '編', '', '編，編髪爲之也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (915, '次', '', '次，次第髪也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (916, '髲鬄', '被𩮜', '髲鬄，髲，被也。髪少者得以被助其髪也。鬄，剔[𩮜]也，剔刑人之髪爲之也。', '釋首飾第十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (917, '步搖', '', '步搖，上有垂珠，步則搖也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (918, '槶', '恢', '簂，恢也，恢廓覆髪上也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (919, '頍', '傾', '簂，魯人曰頍，頍，傾也，著之傾近前也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (920, '皃', '', '簂，齊人曰𢂹，飾形貌也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (921, '華勝', '', '華勝，華，象草木華也。勝，言人形容正等，一人著之則勝也。蔽髪前爲飾也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (922, '叉', '', '釵，枝也。象枝之形，因形名之也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (923, '爵叉', '', '爵釵，釵頭施爵也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (924, '瑱', '鎭', '瑱，鎭也，縣當耳旁，不欲使人妄聽，自鎭重也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (925, '充耳', '', '瑱，或曰充耳，充塞其耳，亦所以止聽也。故里語曰：「不瘖不聾，不成姑公。」。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (926, '當', '', '穿耳施珠曰璫，此本出於蠻夷所爲也，蠻夷婦女輕淫好走，故以此璫錘之也。今中國人效之耳。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (927, '脂', '厎', '脂，砥[厎]也，著面柔滑，如砥石也。', '釋首飾第十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (928, '粉', '分', '粉，分也，研米使分散也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (929, '䞓粉', '赤', '䞓粉，䞓，赤也，染粉使赤，以著頰上也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (930, '胡粉', '𩱍', '胡粉，胡，餬[𩱍]也，脂和之如餬，以塗面也。', '釋首飾第十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (931, '黱', '代', '黛，代也，滅眉毛去之，以此畫代其處也。', '釋首飾第十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (932, '脣脂', '', '脣脂，以丹作之，象脣赤也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (933, '香澤', '', '香澤，人髪恆枯顇，以此濡澤之也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (934, '彊', '', '彊，其性凝强，以制服亂髪也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (935, '旳', '灼', '以丹注面曰旳。旳，灼也，此本天子諸矦羣妾當以次進御，其有月事者，止而不御，重以口說，故注此丹於面，灼然爲識，女史見之，則不書其名於第録也。', '釋首飾第十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (936, '衣', '依', '凡服，上曰衣。衣，依也，人所依以芘寒暑也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (937, '裳', '障', '凡服，下曰裳。裳，障也，所以自障蔽也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (938, '領', '頸', '領，頸也，以壅頸也。亦言緫領，衣體爲端首也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (939, '襟', '禁', '襟，禁也，交於前，所以禁禦風寒也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (940, '袂', '𤸪', '袂，掣[𤸪]也；掣，開也，開張之，以受臂屈伸也。', '釋衣服第十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (941, '袪', '虛', '袪，虛也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (942, '褎', '由受', '袖，由也，手所由出入也。亦言受也，以受手也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (943, '紟', '禁', '衿亦禁也，禁使不得解散也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (944, '帶', '', '帶，蔕也，著於衣，如物之繫蔕也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (945, '系', '繫', '系，繫也，相聯繫也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (946, '衽', '澹', '衽，襜[澹]也，在旁襜襜然也。', '釋衣服第十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (947, '裾', '倨居', '裾，倨也，倨倨然直也。亦言在後常見踞[居]也。', '釋衣服第十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (948, '玄端', '', '玄端，玄衣也。其幅下正直端方，與要接也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (949, '素積', '', '素積，素裳也，辟積其要中使踧，因以名之也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (950, '褘衣', '', '王后之六服有褘衣，畫翬雉之文於衣也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (951, '翬', '', '伊洛而南，雉素質五色皆備成章曰翬。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (952, '鷂翟', '', '鷂翟，畫鷂雉之文於衣也。江淮而南，雉靑質五采皆備成章曰鷂。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (953, '闕翟', '', '闕翟，翦闕繒爲翟雉形以綴衣也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (954, '鞠衣', '䕮', '鞠衣，黃如菊[䕮]華色也。', '釋衣服第十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (955, '亶衣', '坦', '襢衣，襢，坦也，坦然正白無文采也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (956, '彖衣', '熏', '褖衣，褖然黑[熏]色也。', '釋衣服第十六', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (957, '巿', '蔽', '韍，韠也。韠，蔽膝也，所以蔽膝前也。婦人蔽膝亦如之。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (958, '巨巾', '', '韍，齊人謂之巨巾。田家婦女出至田野，以覆其頭，故因以爲名也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (959, '跪襜', '澹', '韍，齊人又謂之跪襜，跪時襜襜[澹]然張也。', '釋衣服第十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (960, '佩', '倍', '佩，倍也，言其非一物，有倍貳也：有珠、有玉、有容刀、有帨巾、有觽之屬也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (961, '襦', '煗', '襦，煗也，言温煗也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (962, '袴', '跨', '袴，跨也，兩股各跨別也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (963, '褺', '襲', '褶，襲也，覆上之言也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (964, '襌複', '', '襌衣，言無裏也。有裏曰複，無裏曰襌。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (965, '襡', '屬', '䙱，屬也，衣裳上下相聯屬也。荆州謂襌衣曰布䙱，亦是也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (966, '襜褕', '澹裕', '荆州謂襌衣曰襜褕，言其襜襜[澹]宏裕也。', '釋衣服第十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (967, '褠', '溝', '褠，襌衣之無胡者也，言袖夾直，形如溝也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (968, '中衣', '', '中衣，言在小衣之外，大衣之中也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (969, '兩當', '', '裲襠，其一當胸，其一當背，因以名之也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (970, '鬕腹', '', '帕腹，橫帕[佰]其腹也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (971, '勹腹', '', '抱腹，上下有帶，抱裹其腹上，無襠者也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (972, '心衣', '', '心衣，抱腹而施鉤肩，鉤肩之閒施一襠，以奄心也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (973, '襑', '芟', '衫，芟也，芟末無袖端也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (974, '反閉', '', '反閉，襦之小者也。卻向著之，領含於項，反於背後，閉其襟也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (975, '圭', '', '婦人上服曰袿，其下垂者上廣下狹，如刀圭也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (976, '巽', '緣', '襈，緣也，靑絳爲之緣也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (977, '帬', '羣', '裙，下裳也。裙，羣也，聯接羣幅也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (978, '緝下', '', '緝下，橫縫緝其下也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (979, '緣裙', '', '緣裙，裙施緣也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (980, '緣襡', '', '緣䙱，䙱施緣也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (981, '帔', '披', '帔，披也，披之肩背，不及下也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (982, '直領', '', '直領，領邪直而交下，亦如丈夫服袍方也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (983, '交領', '', '交領，就形名之也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (984, '曲領', '', '曲領，在內，所以禁中衣領，上橫壅頸，其狀曲也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (985, '袷襦', '', '袷襦，如襦而無絮也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (986, '要襦', '', '要襦，形如襦，其要上翹，下齊要也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (987, '半褎', '', '半袖，其袂半襦而施袖也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (988, '畱幕', '牢絡', '留幕，冀州所名大褶[褻]，下至膝者也。留，牢也；幕，絡也，言牢絡在衣表也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (989, '袍', '勹', '袍，丈夫著，下至跗者也。袍，苞[勹]也，苞內衣也。婦人以絳作衣裳，上下連，四起施緣，亦曰袍，義亦然也。', '釋衣服第十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (990, '侯䄖', '解瀆', '齊人謂如衫而小袖曰侯，侯頭猶解瀆，臂直通之言也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (991, '被', '', '被，被也，被覆人也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (992, '衾', '广', '衾，广也，其下廣大，如广受人也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (993, '汗衣', '', '汗衣，近身受汗垢之衣也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (994, '澤', '', '汗衣，詩謂之澤，受汗澤也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (995, '啚但羞但', '', '汗衣，或曰鄙袒，或曰羞袒，作之，用六尺裁，足覆胸背，言羞鄙於袒而衣此耳。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (996, '㡓', '貫', '褌，貫也，貫兩腳，上繫要中也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (997, '幅', '畐', '幅，所以自偪[畐]束也。', '釋衣服第十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (998, '行縢', '滕', '幅，今謂之行縢，言以裹腳，可以跳騰[滕]輕便也。', '釋衣服第十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (999, '韤', '末', '韤，末也，在腳末也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1000, '𡳐', '禮', '履，禮也，飾足所以爲禮也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1001, '舄', '昔', '複其下曰舄。舄，腊[昔]也，行禮久立，地或泥溼，故複其下，使乾腊也。', '釋衣服第十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1002, '屨', '拘', '屨，拘也，所以拘足也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1003, '屝', '皮', '齊人謂草屨曰屝。屝，皮也，以皮作之也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1004, '不借', '', '齊人謂草屨曰不借，言賤易有，宐各自蓄之，不假借人也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1005, '搏昔巴鮺', '', '謂草屨曰搏腊，搏腊猶巴鮺，麤貌也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1006, '𧆓', '措', '荆州人謂草屨曰𧆓，絲麻韋草，皆同名也。𧆓，措也，言所以安措足也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1007, '屩', '蹻', '屩，草屨也。屩，蹻也，出行著之，蹻蹻輕便，因以爲名也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1008, '屐', '榰', '屐，榰也，爲雨，足榰以踐泥也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1009, '華', '跨', '鞾，跨也，兩足各以一跨騎也。本胡服，趙武靈王服之。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1010, '索睪', '束躅', '𩌈𩍜，鞾之缺前壅者，胡中所名也。𩌈𩍜猶速獨[束躅]，足直前之言也。', '釋衣服第十六', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1011, '鞵', '解', '鞵，解也，著時縮其上，如履然，解其上則舒解也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1012, '帛屐', '', '帛屐，以帛作之，如屩者，不曰帛屩者，屩不可踐泥者也。屐可以踐泥也。此亦可以步泥而浣之，故謂之屐也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1013, '夗下', '', '䩩下，如舄，其下宛宛而危，婦人短者著之，可以拜也。', '釋衣服第十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1014, '靸', '襲', '靸，韋履深頭者之名也。靸，襲也，以其深襲覆足也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1015, '仰角', '', '仰角，屐上施履之名也。行不得蹶，當仰履角，舉足乃行也。', '釋衣服第十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1016, '宮', '穹', '宮，穹也，屋見於垣上，穹隆然也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1017, '室', '實', '室，實也，人物實滿其中也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1018, '奥', '', '室中西南隅曰奥，不見戶明，所在秘奥也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1019, '屋屚', '', '西北隅曰屋漏。禮，每有親死者，輒撤屋之西北隅，薪以爨竈煮沐，供諸喪用。時若直雨，則漏，遂以名之也。必取是隅者，禮，旣祭，改設饌於西北隅，今徹毀之，示不復用也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1020, '𥥍', '幽', '東南隅曰窔，窔，幽也，亦取幽冥也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1021, '宧', '', '東北隅曰宧，宧，頤也，頤，養也，東北陽氣始出，布養物也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1022, '中霤', '', '中央曰中霤。古者𥨍穴，後室之霤，當今之棟下直室之中，古者霤下之處也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1023, '宅', '擇', '宅，擇也，擇吉處而營之也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1024, '舍', '', '舍，於中舍息也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1025, '宇', '羽', '宇，羽也，如鳥羽翼，自覆蔽也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1026, '屋', '燠', '屋亦奥也，其中温奥[𥁕燠]也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1027, '宗廟', '尊皃', '宗廟。宗，尊也。廟，貌[皃]也，先祖形貌所在也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1028, '寑', '', '寢，寢也，所以寢息也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1029, '城', '盛', '城，盛也，盛受國都也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1030, '𩫏', '', '郭，廓也，廓落在城外也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1031, '俾倪', '', '城上垣曰睥睨，言於其孔中睥睨非常也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1032, '陴', '裨', '睥睨，一曰陴。陴，裨也，言裨助城之高也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1033, '女牆', '', '睥睨，一曰女牆，言其卑小，比之於城，若女子之於丈夫也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1034, '𡑢', '曡', '睥睨，一曰堞，取重曡之義也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1035, '寺', '嗣', '寺，嗣也，治事者相嗣續於其內也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1036, '廷', '亭', '廷，停[亭]也，人所停集之處也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1037, '獄', '确', '獄，确也，言實确，人之情僞也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1038, '牢', '', '獄，一曰牢，言所在堅牢也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1039, '圜土', '', '獄，一曰圜土，言築土表牆，其形圜也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1040, '囹圄', '領御', '獄，一曰囹圄。囹，領也；圄，御也。領録囚徒，禁御之也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1041, '亭', '', '亭，亦人所停集也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1042, '傳', '轉', '傳，轉也，人所止息而去，後人復來，轉轉相傳，無常主也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1043, '瓦', '踝𧝹', '瓦，踝也；踝，确堅貌也。亦言腂[𧝹]也，在外腂見也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1044, '梁', '', '梁，言彊梁也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1045, '柱', '侸', '柱，住[侸]也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1046, '檼', '隱', '檼，隱也，所以隱桷也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1047, '望', '', '檼，一曰望，言高可望也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1048, '棟', '中', '檼，一曰棟，棟，中也，居屋之中也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1049, '桷', '', '桷，确也，确堅而直也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1050, '椽', '傳', '桷，一曰椽，椽，傳也，相傳次而布列也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1051, '榱', '𤸬', '桷，一曰榱，在檼旁下列，衰[𤸬]衰然垂也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1052, '梠', '旅', '梠，旅也，連旅旅也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1053, '櫋', '緜', '梠，一曰櫋。櫋，緜也，緜連榱頭，使齊平也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1054, '爵頭', '', '梠，上入曰爵頭，形似爵頭也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1055, '楣', '眉', '楣，眉也，近前各兩，若面之有眉也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1056, '棳需', '侏儒', '棳檽，梁上短柱也。棳檽猶侏儒，侏儒短，故以名之也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1057, '梧', '牾', '梧，在梁上兩頭，相觸牾也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1058, '欒', '攣', '欒，攣也，其體上曲，攣拳然也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1059, '櫨', '盧', '櫨，在柱頭，如都盧，負屋之重也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1060, '斗', '', '斗，在欒兩頭如斗也。亦言斗上負檼也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1061, '笮', '', '笮，迮也，編竹相連迫迮也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1062, '甍', '冡', '屋脊曰甍，甍，蒙[冡]也，在上覆蒙屋也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1063, '壁', '僻', '壁，辟[僻]也，所以辟禦風寒也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1064, '牆', '障', '牆，障也，所以自障蔽也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1065, '垣', '援', '垣，援也，人所依阻，以爲援衞也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1066, '墉', '頌', '墉，容[頌]也，所以蔽隱形容也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1067, '杝', '離', '籬，離也，以柴竹作之，疏離離也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1068, '豦', '居', '籬，靑徐曰椐，椐，居也，居於中也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1069, '柵', '迹', '柵，蹟[迹]也，以木作之，上平蹟然也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1070, '屮', '緊', '柵，一曰徹，徹，緊也，詵詵然緊也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1071, '殿', '', '殿，有殿鄂也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1072, '陛', '卑', '陛，卑也，有高卑也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1073, '內陛', '', '天子殿謂之納陛，言所以納人言之階陛也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1074, '階', '', '階，梯也。如梯之有等差也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1075, '陳', '敶', '陳，堂塗也，言賓主相迎陳[敶]列之處也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1076, '屏', '', '屏，自障屏也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1077, '蕭牆', '肅', '蕭牆，在門內。蕭，肅也。臣將入於此，自肅敬之處也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1078, '宁', '', '宁，佇也，將見君，所佇立定氣之處也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1079, '序', '敘', '序，有次序[敘]也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1080, '夾室', '', '夾室，在堂兩頭，故曰夾也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1081, '堂', '', '堂犹堂堂，高顯貌也。名堂亦如之。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1082, '房', '旁', '房，旁也，室之兩旁也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1083, '楹', '亭', '楹，亭也，亭亭然孤立，旁無所依也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1084, '輕', '勝', '齊魯謂楹曰輕，輕，勝也，孤立獨處，能勝任上重也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1085, '檐', '儋', '檐，儋也，接儋屋前後也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1086, '𩅸', '𣹳', '霤，流[𣹳]也，水從屋上流下也。', '釋宮室第十七', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1087, '闕', '缺', '闕，在門兩旁，中央闕[缺]然爲道也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1088, '罘思', '復', '罘罳，在門外。罘，復也；罳，思也。臣將入請事，於此復重思之也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1089, '觀', '', '觀，觀也，於上觀望也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1090, '樓', '婁', '樓，謂牗戶之閒有射孔，婁婁然也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1091, '臺', '持', '臺，持也，築土堅高，能自勝持也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1092, '顱', '露', '櫓，露也，露上無覆屋也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1093, '門', '捫', '門，捫也，在外爲人所捫摸也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1094, '闈', '衞', '闈，衞也，在內以自障衞也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1095, '戶', '護', '戶，護也，所以謹護閉塞也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1096, '囪', '聰', '窻，聦[聰]也，於內窥外，爲聦明也。', '釋宮室第十七', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1097, '茨', '次', '屋以草葢曰茨。茨，次也，次比草爲之也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1098, '廬', '慮', '寄止曰廬。廬，慮也，取自覆慮也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1099, '蒲', '𢾭', '草圓屋曰蒲。蒲，敷[𢾭]也，總其上而敷下也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1100, '广', '奄', '蒲，一曰庵，庵，奄也，所以自覆奄也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1101, '廡', '幠', '大屋曰廡。廡，幠也；幠，覆也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1102, '庌', '雅', '廡，幽、冀人謂之庌，庌，雅也；雅，正也，屋之正大者也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1103, '井', '淸', '井，淸也，泉之淸潔者也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1104, '瀱汋', '竭', '井一有水一無水曰瀱汋。瀱，竭也；汋，有水聲汋汋也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1105, '竈', '造', '竈，造也，造創食物也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1106, '爨', '銓', '爨，銓也，銓度甘辛調和之處也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1107, '倉', '臧', '倉，藏[臧]也，藏穀物也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1108, '庫', '舍', '庫，舍也，物所在之舍也，故齊魯謂庫曰舍也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1109, '廏', '勼', '廏，勼也；勼，聚也，牛馬之所聚也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1110, '廩', '憐', '廩，矜[憐]也，寶物可矜惜者，投之其中也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1111, '囷', '卷', '囷，綣[卷]也，藏物繾綣束縛之也。', '釋宮室第十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1112, '庾', '裕', '庾，裕也，言盈裕也，露積之言也。盈裕不可稱受，所以露積之也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1113, '庉', '屯', '庉，屯也，屯聚之也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1114, '篅', '團', '圌，以草作之，團團然也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1115, '廁', '雜', '廁，雜也。言人雜廁在上，非一也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1116, '溷', '', '廁，或曰溷，言溷濁也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1117, '清', '', '廁，或曰圊，至穢之處，宜常修治，使潔淸也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1118, '軒', '', '廁，或曰軒，前有伏，似殿軒也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1119, '泥', '邇', '泥，邇也；邇，近也。以水沃土，使相黏近也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1120, '涂', '杜', '塗，杜也，杜塞孔穴也。', '釋宮室第十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1121, '堊', '亞', '堊，亞也；亞，次也。先泥之，次以白灰飾之也。', '釋宮室第十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1122, '𡏲', '緭', '墍猶煟[緭]煟，細澤貌也。', '釋宮室第十七', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1123, '牀', '裝', '人所坐臥曰牀。牀，裝也，所以自裝載也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1124, '榻', '', '牀長狹而卑曰榻，言其體榻然近地也。', '釋牀帳第十八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1125, '獨坐', '', '榻之小者曰獨坐，主人無二，獨所坐也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1126, '枰', '平', '枰，平也，以板作之，其體平正也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1127, '几', '支', '几，庪[支]也，所以庪物也。', '釋牀帳第十八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1128, '筵', '衍', '筵，衍也，舒而平之，衍衍然也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1129, '席', '釋', '席，釋也，可卷可釋也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1130, '簟', '覃', '簟，覃也，布之，覃覃然平正也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1131, '荐', '薦', '薦，所以自薦藉也。', '釋牀帳第十八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1132, '蒲平', '', '蒲平，以蒲作之，其體平也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1133, '氈', '旃', '氊，旃也，毛相著旃旃然也。', '釋牀帳第十八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1134, '蓐', '辱', '褥，辱也，人所坐䙝辱也。', '釋牀帳第十八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1135, '氍毹', '寠數', '裘溲猶寠數，毛相離之言也。', '釋牀帳第十八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1136, '榻登', '', '榻登，施之承大牀之前、小榻上，登以上牀也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1137, '貂席', '', '貂席，連貂皮以爲席也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1138, '枕', '檢', '枕，檢也，所以檢項也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1139, '帷', '圍', '帷，圍也，所以自障圍也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1140, '幕', '', '幕，幕絡也，在表之稱也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1141, '帟', '奕', '小幕曰帟，張在人上，帟帟[奕]然也。', '釋牀帳第十八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1142, '幔', '曼', '幔，漫[曼]也，漫漫相連綴之言也。', '釋牀帳第十八', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1143, '帳', '張', '帳，張也，張施於牀上也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1144, '斗帳', '', '小帳曰斗帳，形如覆斗也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1145, '㡘', '', '㡘，亷也，自障蔽爲廉恥也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1146, '幢容', '', '幢容，施之車葢，童童然，以隱蔽形容也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1147, '戶㡘', '', '戶㡘，施之於戸外也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1148, '襜', '聸', '牀前帷曰幨，言幨幨[聸]而垂也。', '釋牀帳第十八', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1149, '幄', '屋', '幄，屋也，以帛衣板施之，形如屋也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1150, '承𪋻', '', '承塵，施於上以承塵土也。', '釋牀帳第十八', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1151, '搏壁', '', '搏壁，以席搏著壁也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1152, '扆', '倚', '扆，倚也，在後所依倚也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1153, '屏風', '', '屏風，言可以屏障風也。', '釋牀帳第十八', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1154, '筆', '述', '筆，述也，述事而書之也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1155, '硯', '研', '硯，研也，研墨使和濡也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1156, '墨', '晦', '墨，晦也，言似物晦黑也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1157, '紙', '厎', '紙，砥[厎]也，謂平滑如砥石也。', '釋書契第十九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1158, '版', '昄', '版，昄也，昄昄平廣也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1159, '奏', '鯫', '奏，鄒[鯫]也，狹小之言也。', '釋書契第十九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1160, '札', '櫛', '札，櫛也，編之如櫛，齒相比也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1161, '𥳑', '閒', '𥳑，閒也，編之篇篇有閒也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1162, '曶', '忽', '笏，忽也，君有敎命，及所啟白，則書其上，備忽忘也。', '釋書契第十九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1163, '薄', '', '笏，一曰簿，言可以簿疏物也。', '釋書契第十九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1164, '槧', '𧽯', '槧，版之長三尺者也。槧，漸[𧽯]也，言其漸漸然長也。', '釋書契第十九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1165, '牘', '睦', '牘，睦也，手執之以進見，所以爲恭睦也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1166, '籍', '', '籍，籍也，所以籍疏人名戶口也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1167, '檄', '激', '檄，激也，下官所以激迎其上之書文也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1168, '檢', '禁', '檢，禁也，禁閉諸物，使不得開露也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1169, '壐', '徙', '壐，徙也，封物使可轉徙而不可發也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1170, '印', '信因', '印，信也，所以封物爲信驗也。亦言因也，封物相因付也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1171, '謁', '詣', '謁，詣也；詣，告也，書其姓名於上，以告所至詣者也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1172, '符', '付赴', '符，付也，書所敕命於上，付使傳行之也。亦言赴也，執以赴君命也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1173, '傳', '轉', '傳，轉也，轉移所在，執以爲信也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1174, '過所', '', '傳，一曰過所，過所至關津以示之也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1175, '券', '卷', '卷，綣[卷]也，相約束繾綣以爲限也。', '釋書契第十九', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1176, '別', '', '莂，別也，大書中央，中破別之也。', '釋書契第十九', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1177, '契', '栔', '契，栔也。栔，刻也，刻識其數也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1178, '策', '', '策，書教令於上，所以驅策諸下也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1179, '册', '嫧', '漢制：約敕封侯曰册。册，賾[嫧]也，敇使整賾，不犯之也。', '釋書契第十九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1180, '示', '', '示，示也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1181, '棨', '詣', '棨，詣也，以告語官司，所至詣也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1182, '書', '庶箸', '書，庶也，紀庶物也。亦言著[箸]也，著之𥳑紙，永不滅也。', '釋書契第十九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1183, '畫', '繪', '畫，繪也，以五色繪物象也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1184, '刺', '', '書稱刺，以筆刺紙𥳑之上也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1185, '寫', '', '書曰寫，倒寫此文也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1186, '畫刺', '', '畫姓名於奏上曰畫刺，作「再拜」「起居」，字皆達其體，使書盡邊，徐引筆書之，如畫者也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1187, '長刺', '', '下官刺曰長刺，長書中央一行而下之也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1188, '爵里刺', '', '下官刺，一曰爵里刺，書其官爵及郡縣鄕里也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1189, '題', '諦弟', '書牘稱題。題，諦也，審諦其名號也。亦言第[弟]也，因其第次也。', '釋書契第十九', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1190, '署', '予', '書文書檢曰署。署，予也，題所予者官號也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1191, '告', '覺', '上敕下曰告。告，覺也，使覺悟知己意也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1192, '表', '', '下言上曰表。思之於內，表施於外也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1193, '上', '', '表，一曰上，示之於上也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1194, '言', '', '表，一曰言，言其意也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1195, '約', '', '約，約束之也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1196, '敕', '飭', '敕，飭也，使自警飭，不敢廢慢也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1197, '謂', '喟', '謂猶喟，得敇不自安，喟喟然也。', '釋書契第十九', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1198, '三墳', '分', '三墳，墳，分也，論三才之分，天、地、人之治，其體有三也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1199, '五典', '鎭', '五典，典，鎭也，制法所以鎭定上下，其等有五也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1200, '八索', '素', '八索，索，素也，著素王之法，若孔子者，聖而不王，制此法者有八也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1201, '九丘', '區', '九丘，丘，區也，區別九州土氣，教化所宐施者也。此皆三王以前上古羲皇時書也。今皆亡，惟堯典存也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1202, '經', '徑', '經，徑也，常典也。如徑路無所不通，可常用也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1203, '緯', '圍', '緯，圍也，反覆圍繞，以成經也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1204, '圖', '度', '圖，度也，盡其品度也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1205, '讖', '纖', '讖，纖也，其義纖微而有效驗也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1206, '易', '', '易，易也，言變易也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1207, '禮', '體', '禮，體也，得其事體也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1208, '儀', '宜', '儀，宜也，得事宜也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1209, '傳', '', '傳，傳也，以傳示後人也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1210, '記', '紀', '記，紀也，紀識之也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1211, '詩', '之', '詩，之也，志之所以也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1212, '興', '', '詩興物而作謂之興，隨作者之志而別名之也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1213, '賦', '敷布', '詩敷布其義謂之賦，隨作者之志而別名之也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1214, '比', '', '詩事類相似謂之比，隨作者之志而別名之也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1215, '雅', '', '詩言王政事謂之雅，隨作者之志而別名之也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1216, '頌', '', '詩稱頌成功謂之頌，隨作者之志而別名之也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1217, '尙書', '上', '尙書，尙，上也，以堯爲上，始而書其時事也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1218, '春秋', '', '春秋，言春秋冬夏終而成歲，舉春秋，則冬夏可知也。春秋書人事，卒歲而究備。春秋温涼中，象政和也，故舉以爲名也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1219, '國語', '', '國語，記諸國君臣相與言語、謀議之得失也。又曰外傳，春秋以魯爲內，以諸國爲外，外國所傳之事也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1220, '外傳', '', '國語，又曰外傳，春秋以魯爲內，以諸國爲外，外國所傳之事也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1221, '爾雅', '暱義', '爾雅，爾，昵[暱]也；昵，近也。雅，義也；義，正也。五方之言不同，皆以近正爲主也。', '釋典藝第二十', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1222, '論語', '', '論語，記孔子與諸弟子所論所語之言也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1223, '法', '畐', '法，逼[畐]也，人莫不欲從其志，逼正使有所限也。', '釋典藝第二十', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1224, '律', '絫', '律，累[絫]也，累人心，使不得放肆也。', '釋典藝第二十', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1225, '令', '領', '令，領也，理領之，使不得相犯也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1226, '科', '課', '科，課也，課其不如法者，罪責之也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1227, '詔', '照', '詔，照也，昭也，人暗不見事宐，則有所犯，以此照示之，使昭然知所由也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1228, '論', '侖', '論，倫[侖]也，有倫理也。', '釋典藝第二十', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1229, '贊', '䉵', '稱人之美曰讚。讚，纂[䉵]也，纂集其美而敘之也。', '釋典藝第二十', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1230, '敘', '抒', '敘，抒也，抒泄其實宣見之也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1231, '名', '', '銘，名也，述其功美，使可稱名也。', '釋典藝第二十', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1232, '誄', '絫', '誄，累[絫]也，累列其事而稱之也。', '釋典藝第二十', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1233, '謚', '曳', '謚，曳也，物在後爲曳，言名之於人亦然也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1234, '普', '布', '譜，布也，布列見其事也。', '釋典藝第二十', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1235, '緒', '敘', '譜，一曰緒，主敘人世，類相繼知統緒也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1236, '碑', '被', '碑，被也。此本王葬時所設也。施於鹿盧，以繩被其上，引以下棺也。臣子追述君父之功美，以書其上。後人因焉。物故，建於道陌之頭、顯見之處，名其文就謂之碑也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1237, '詞', '嗣', '詞，嗣也，令撰善言相續嗣也。', '釋典藝第二十', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1238, '斧', '甫', '斧，甫也；甫，始也。凡將制器，始用斧伐木，巳乃制之也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1239, '鎌', '廉', '鎌，廉也，體廉薄也。其所刈，稍稍取之，又似廉者也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1240, '斨', '戕', '斨，戕也，所伐皆戕毁也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1241, '仇矛', '讎', '仇矛。仇，讎也，所伐則平，如討仇讎也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1242, '錐', '利', '錐，利也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1243, '椎', '推', '椎，推也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1244, '鑿', '', '鑿，有所穿鑿也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1245, '鐫', '鐏', '鐫，鐏也，有所鐏入也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1246, '耒', '來推', '耒，來也，亦推也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1247, '㭒', '齒', '耜，齒也，似齒斷物也。', '釋用器第二十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1248, '𤛿', '利', '犁，利也，利則發土絕草根也。', '釋用器第二十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1249, '亶', '坦', '檀，坦也，摩之使坦然平也。', '釋用器第二十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1250, '鋤', '助', '鋤，助也，去穢助苗長也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1251, '橿', '僵', '齊人謂鋤柄曰橿，畺[僵]然正直也。', '釋用器第二十一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1252, '鶴', '', '齊人謂鋤頭曰鶴，似鶴頭也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1253, '枷', '加', '枷，加也，加杖於柄頭以撾穗而出其穀也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1254, '連枷', '', '枷，一曰羅枷，羅三杖而用之也。', '釋用器第二十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1255, '互', '', '枷，或曰丫，丫以杖轉於頭，故以名之也。', '釋用器第二十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1256, '臿', '', '鍤，插也，插地起土也。', '釋用器第二十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1257, '銚', '削', '鍤，或曰銷，銷，削也，能有所穿削也。', '釋用器第二十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1258, '㭉', '刳', '鍤，或曰鏵，鏵，刳也，刳地爲坎也。', '釋用器第二十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1259, '葉', '', '鍤版曰葉，象木葉也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1260, '杷', '播撥', '杷，播也，所以播除物也。亦言撥也，撥使聚也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1261, '耨', '薅', '耨，似鋤嫗薅禾也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1262, '鎛', '迫', '鎛，亦鋤田器也。鎛，迫也，迫地去草也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1263, '冓', '溝', '𨪋，溝也，既割去壟上草，又辟其土以壅苗根，使壟下爲溝，受水潦也。', '釋用器第二十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1264, '乂', '殺', '鉪，殺也，言殺草也。', '釋用器第二十一', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1265, '銍', '挃', '銍，穫黍鐵也；銍銍[挃]，斷黍穗聲也。', '釋用器第二十一', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1266, '斤', '謹', '斤，謹也，版廣不可得削，又有節，則用此斤之，所以詳謹，令平滅斧跡也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1267, '鏟', '澌', '鐁，斯[澌]也，斤有高下之跡，以此斯彌其上而平之也。', '釋用器第二十一', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1268, '鋸', '倨', '鋸，倨也，其體直，所𢧵應倨句之平也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1269, '钃', '誅', '钃，誅也，主以誅除物根株也。', '釋用器第二十一', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1270, '鐘', '空', '鐘，空也，內空受氣多，故聲大也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1271, '磬', '硻', '磬，罄[硻]也，其聲罄罄然堅緻也。', '釋樂器第二十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1272, '鼓', '郭', '鼓，郭也，張皮以冒之，其中空也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1273, '鞀', '導', '鞉，導也，所以導樂作也。', '釋樂器第二十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1274, '鼙', '裨', '鼙，裨也，裨助鼓節也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1275, '朔', '', '鼙在前曰朔，朔，始也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1276, '應', '', '鼙在後曰應，應大鼓也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1277, '鐉', '峻', '所以縣鐘鼓者，橫曰簨，簨，峻也，在上高峻也。', '釋樂器第二十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1278, '𧇽', '舉', '所以縣鐘鼓者，從曰虡，虡，舉也，在旁舉簨也。', '釋樂器第二十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1279, '業', '', '簨上之版曰業，刻爲牙，捷業如鋸齒也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1280, '瑟', '', '瑟，施弦張之，瑟瑟然也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1281, '箏', '錚', '箏，施弦高急，箏箏[錚]然也。', '釋樂器第二十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1282, '筑', '築', '筑，以竹鼓之，筑筑[築]然柲之也。', '釋樂器第二十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1283, '空矦', '', '箜篌，此師延所作，靡靡之樂也。後岀於桑閒濮上之地，葢空國之侯所存也。師涓爲晉平公鼓焉，鄭衞分其地而有之，遂號「鄭衞之音」，謂之「淫樂」也。', '釋樂器第二十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1284, '𢱧𢃳', '', '批把，本出於胡中，馬上所鼓也。推手前曰批，引手卻曰把，象其鼓時，因以爲名也。', '釋樂器第二十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1285, '壎', '喧', '塤，喧也，聲濁喧喧然也。', '釋樂器第二十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1286, '䶵', '嗁', '篪，啼[嗁]也，聲從孔出，如嬰兒啼聲也。', '釋樂器第二十二', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1287, '簫', '肅', '簫，肅也，其聲肅肅而淸也　。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1288, '笙', '生', '笙，生也，竹之貫匏，象物貫地而生也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1289, '匏', '', '笙，竹之貫匏，以匏爲之，故曰匏也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1290, '竽', '汙', '竽，汙也，其中汙空，以受簧也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1291, '簧', '橫', '簧，橫也，於管頭橫施於中也，以竹鐵作，於口橫鼓之亦是也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1292, '摶拊', '拊𢫦', '搏拊，以韋盛穅，形如鼓，以手附拍[拊𢫦]之也。', '釋樂器第二十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1293, '柷敔', '衙', '柷敔。柷，狀如桼桶，柷，始也，如物始見，柷柷然如作樂也。敔，狀如伏虎。敔，衙也。衙，止也，所以止樂也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1294, '舂牘', '撞築', '舂牘，舂，撞也；牘，築也，以撞築地爲節也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1295, '龠', '躍', '籥，躍也，氣躍出也。', '釋樂器第二十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1296, '笛', '滌', '篴，滌也，其聲滌滌然也。', '釋樂器第二十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1297, '鐃', '譊', '鐃，聲鐃鐃[譊]也。', '釋樂器第二十二', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1298, '歌', '柯', '人聲曰歌。歌，柯也，所歌之言是其質也，以聲吟詠有上下，如草木之有柯葉也。故兖冀言歌，聲如柯也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1299, '䶴', '推', '竹曰吹。吹，推也，以氣推發其聲也。', '釋樂器第二十二', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1300, '吟', '嚴', '吟，嚴也，其聲本出於憂愁，故其聲嚴肅，使人聽之悽歎也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1301, '擊壤', '', '壤擊壤，野老之戯也。', '釋樂器第二十二', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1302, '弓', '穹', '弓，穹也，張之穹隆然也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1303, '簫', '稍', '弓末曰簫，簫言梢[稍]也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1304, '弭', '', '弓末曰弭，以骨爲之，滑弭弭也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1305, '㓡', '撫', '弓中央曰弣，弣，撫也，人所撫持也。', '釋兵第二十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1306, '淵', '宛', '弓簫、弣之閒曰淵，淵，宛也，言曲宛也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1307, '弩', '怒', '弩，怒也，言其聲勢威嚮如怒也，故以名其弩也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1308, '臂', '', '弩柄曰臂，似人臂也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1309, '牙', '', '弩鉤弦者曰牙，似齒牙也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1310, '郭', '', '弩牙外曰郭，爲牙之規郭也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1311, '縣刀', '', '弩牙下曰縣刀，其形然也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1312, '機', '', '弩其含括之口曰機，言如機之巧也，亦言如門戶之樞機，開闔有節也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1313, '矢', '指', '矢，指也，言其有所指向迅疾也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1314, '箭', '進', '箭，進也，言前進也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1315, '足', '', '矢本曰足，矢形如木，木以下爲本，矢以本爲足也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1316, '鏑', '敵', '鏑，敵也，可以禦敵也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1317, '族', '丵', '鏑，齊人謂之鏃，鏃，族[丵]也，言其所中皆族滅也。', '釋兵第二十三', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1318, '交', '', '鏑，關西曰鉸，鉸，交也，言有交刃也。', '釋兵第二十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1319, '幹', '', '矢體曰幹，言梃幹也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1320, '羽', '', '矢旁曰羽，如鳥羽也。鳥須羽而飛，矢須羽而前也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1321, '衞', '', '矢羽，齊人曰衞，所以導衞矢也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1322, '桰', '會', '矢末曰栝，栝，會也，與弦會也。', '釋兵第二十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1323, '叉', '', '栝旁曰叉，形似叉也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1324, '箙', '服', '矢受之器，以皮曰箙，謂柔服之義也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1325, '笮', '', '箙，織竹曰笮，相迫笮之名也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1326, '步叉', '', '箙，一曰步叉，人步所帶，以箭叉於其中也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1327, '鞬', '建', '箙，馬上曰鞬，鞬，建也，弓矢並建立其中也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1328, '刀', '到', '刀，到也，以斬伐到其所，乃擊之也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1329, '鋒', '蠭', '刀末曰鋒，言若蠭刺之毒利也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1330, '環', '', '刀本曰環，形似環也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1331, '削', '峭', '刀室曰削，削，峭也，其形峭殺，裹刀體也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1332, '琫', '捧', '刀室口之飾曰琫，琫，捧也，捧束口也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1333, '珌', '卑', '刀下末之飾曰琕，琕，卑也，在下之言也。', '釋兵第二十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1334, '𢫦髀', '', '短刀曰拍髀，帶時拍髀旁也。', '釋兵第二十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1335, '露𢫦', '', '短刀，一曰露拍，言露見也。', '釋兵第二十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1336, '佩刀', '', '佩刀，在佩旁之刀也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1337, '容刀', '', '佩刀，一曰容刀，有刀形而無刃，備儀容而巳。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1338, '剪刀', '進', '剪刀，剪，進也，所剪稍進前也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1339, '書刀', '', '書刀，給書𥳑札，有所刊削之刀也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1340, '封刀鉸刀', '', '封刀、鉸刀，皆隨時名之也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1341, '㦸', '𠲱', '㦸，格[𠲱]也，旁有枝格也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1342, '戈', '過', '戈，句孑㦸也。戈，過也，所刺擣則決過，所鉤引則制之弗得過也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1343, '常', '', '車㦸曰常，長丈六尺，車上所持也。八尺曰尋，倍尋曰常，故稱常也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1344, '手㦸', '', '手㦸，手所持擿之㦸也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1345, '矛', '冒', '矛，冒也，刃下冒矜也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1346, '鐏', '', '矛下頭曰鐏，鐏入地也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1347, '松櫝', '束躅', '矛矜曰松櫝，刃長三尺，其矜宜輕，以松作之也。櫝，速獨[束躅]，前刺之言也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1348, '梢', '稍', '矛長丈八尺曰矟，馬上所持，言其矟矟[稍]便殺也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1349, '激矛', '', '矟，又曰激矛，可以激𢧵敵陳之矛也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1350, '仇矛', '', '仇矛，頭有三叉，言可以討仇敵之矛也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1351, '夷矛', '𢓡', '夷矛，其矜長丈六尺。不言常而曰夷者，言其可夷[𢓡]滅敵，亦車上所持也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1352, '𣒃矛', '靃', '𥍧矛，長九尺者也。𥍧，霍[靃]也，所中霍然即破裂也。', '釋兵第二十三', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1353, '殳', '殊', '殳，殊也，長丈二尺而無刃，有所撞挃於車上，使殊離也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1354, '盾', '遯', '盾，遯也，跪其後，避刃似隱遯也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1355, '吳魁', '顝', '盾大而平者曰吳魁，本出於吳，爲魁[顝]帥者所持也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1356, '滇盾', '', '盾隆者，一曰滇盾，本出於蜀，蜀、滇所持也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1357, '羌盾', '', '盾隆者，一曰羌盾，言出於羌也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1358, '陷虜露見', '', '盾約脇而鄒者曰陷虜，言可以陷破虜敵也，今謂之曰露見是也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1359, '步盾', '', '盾狹而長者曰步盾，步兵所持，與刀相配者也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1360, '孑盾', '', '盾狹而短者曰孑盾，車上所持者也。孑，小稱也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1361, '木絡犀盾木盾', '', '盾以縫編版謂之木絡，以犀皮作之曰犀盾，以木作之曰木盾，皆因所用爲名也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1362, '彭排', '旁', '彭排，彭，旁也，在旁排敵禦攻也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1363, '鎧介函', '艮', '鎧猶塏，塏[艮]，堅重之言也。或謂之介、或謂之函，亦如之也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1364, '甲', '', '鎧謂之甲，似物有孚甲，以自禦也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1365, '劎', '檢斂', '劎，檢也，所以防檢非常也。又言斂也，其在身拱時斂在臂內也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1366, '鐔', '尋', '劎旁鼻曰鐔，鐔，尋也，帶所貫尋也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1367, '鏠', '', '劎末曰鋒，鋒末之言也。', '釋兵第二十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1368, '鋋', '延', '鋋，延也；延，達也，去此至彼之言也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1369, '鉤鑲', '攘', '鉤鑲，兩頭曰鉤，中央曰鑲，或推攘、或鉤引用之之宜也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1370, '常', '', '九旗之名，日月爲常，畫日月於其端，天子所建，言常明也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1371, '旂', '倚', '交龍爲旂，旂，倚也，畫作兩龍相依倚也，諸侯所建也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1372, '旃', '戰', '通帛爲旃，旃，戰也，戰戰恭己而巳也。通以赤色爲之，無文采，三孤，所建象無事也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1373, '旗', '期', '熊虎爲旗，軍將所建，象其猛如熊虎，與衆期其下也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1374, '旟', '譽', '鳥隼爲旟，旟，譽也，軍吏所建，急疾趨事，則有稱譽也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1375, '勿', '物', '雜帛爲物，以雜色綴其邊，爲燕尾也。將帥所建，象物雜色也。', '釋兵第二十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1376, '旐', '兆', '龜蛇爲旐，旐，兆也。龜蛇知氣兆之吉凶，建之於後，察度事宜之形兆也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1377, '旞', '滑', '全羽爲𣄧，𣄧猶滑，順滑之貌也。', '釋兵第二十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1378, '旌', '精', '析羽爲旌，旌，精也，有精光也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1379, '緌', '繠', '緌，有虞氏之旌也，注旄竿首，其形橤[繠]橤然也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1380, '綏', '𤸬', '緌，一曰綏，夏后氏之旌也，其形衰[𤸬]衰也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1381, '白斾', '帛', '白斾，殷旌也，以帛繼旐末也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1382, '翿', '陶', '翳，陶也，其貌陶陶下垂也。', '釋兵第二十三', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1383, '幢', '童', '幢，童也，其貌童童然也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1384, '旛', '蕃', '旛，幡[蕃]也，其貌幡幡然也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1385, '校', '號', '校，號也，將帥號令之所在也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1386, '節', '', '節，號令賞罰之節也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1387, '鐸', '度', '鐸，度也，號令之限度也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1388, '金鼓', '禁', '金鼓，金，禁也，爲進退之禁也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1389, '戚', '慽', '戚，慼[慽]也，斧以斬斷，見者皆慼懼也。', '釋兵第二十三', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1390, '戉', '豁', '戉，豁也，所向莫敢當前，豁然破散也。', '釋兵第二十三', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1391, '車', '居舍', '車，古者曰車、聲如居，言行所以居人也。今曰車，聲近舍，行者所處，若舍也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1392, '玉輅', '路', '天子所乘曰玉輅，以玉飾車也。輅亦車也，謂之輅者，言行於道路也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1393, '金輅象輅革輅木輅', '', '金輅、象輅、革輅、木輅，各隨所以爲飾名之也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1394, '鉤車', '', '鉤車，以行爲陳，鉤股曲直有正，夏所制也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1395, '胡奴車', '', '胡奴車，東胡以罪没入官，爲奴者引之，殷所制也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1396, '元戎車', '', '元戎車，元戎在軍前啓突敵陳，周所制也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1397, '輦車', '連', '輦車，人所輦[連]也。', '釋車第二十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1398, '柏車', '伯', '柏車，柏，伯也；伯，大也，丁夫服任之大車也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1399, '羊車犢車', '祥', '羊車，羊，祥也；祥，善也，善飾之車，今犢車是也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1400, '墨車', '', '墨車，漆之正黑如墨，無文飾，大夫所乘也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1401, '重較', '', '重較，其較重，卿所乘也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1402, '役車', '', '役車，給役之車也。庶人所乘也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1403, '棧車', '靖', '棧車，棧，靖也，庥靖物之車也，庶人所乘也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1404, '軘車', '', '軘車，戎者所乘也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1405, '容車', '', '容車，婦人所載小車也。其葢施帷，所以隱蔽其形容也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1406, '衣車', '', '衣車，前戶，所以載衣服之車也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1407, '獵車', '', '獵車，所乘以畋獵也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1408, '小車', '', '小車，駕馬輕小之車也。駕馬宜輕，故使之局小也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1409, '高車', '', '高車，其葢高，立乘載之車也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1410, '安車', '', '安車，葢卑坐乘，今吏所乘小車也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1411, '驘車羊車', '', '驘車、羊車，各以所駕名之也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1412, '檻車', '', '檻車，上施檻欄，以格猛獸，亦囚禁罪人之車也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1413, '軺車', '䌛', '軺車，軺，遙[䌛]也；遙，遠也，四向遠望之車也。', '釋車第二十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1414, '輜車', '廁', '輜車，載輜重臥息其中之車也。輜，廁也，所載衣物雜廁其中也。輜軿之形同，有邸曰輜，無邸曰軿。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1415, '軿車', '屏', '軿車，軿，屏也，四面屏蔽，婦人所乘牛車也。輜軿之形同，有邸曰輜，無邸曰軿。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1416, '輈', '句', '輈，句也，轅上句也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1417, '衡', '橫', '衡，橫也，橫馬頸上也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1418, '游環', '', '游環，環在服馬背上、驂馬之外，轡貫之，游移前卻，無定處也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1419, '脅驅', '', '脅驅，在服馬外脅也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1420, '陰靷', '蔭引', '陰，蔭也，橫側車前，所以蔭笭也。靷，所以引車也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1421, '鋈', '𦰚', '鋈，沃[𦰚]也，冶白金以沃灌靷環也。', '釋車第二十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1422, '續', '', '續，續靷端也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1423, '文鞇', '因', '文鞇，車中所坐者也。用虎皮爲之，有文采。鞇，因也，因與下輿相聯著也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1424, '絥', '伏', '𩊙，伏也，在前，人所伏也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1425, '軾', '式', '軾，式也，所伏以式敬者也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1426, '屟', '', '茵谓之靯𩍿，車中重薦也。輕靯𩍿，小䂏[𧜣]也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1427, '轂', '确', '轂，确也，體堅确也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1428, '轅', '援', '轅，援也，車之大援也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1429, '桄', '', '桄，黃也。橫在前，如臥牀之有枕也。橫在下，薦版在上，如薦席也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1430, '縮育', '', '齊人謂車桄以前曰縮，言局縮也。兖冀謂之育，御者坐中執御，育育然也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1431, '較', '', '較，在箱上，爲辜較也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1432, '立人', '', '立人，象人立也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1433, '陽門', '', '立人，一曰陽門，在前曰陽，兩旁似門也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1434, '槅', '戹', '槅，枙[戹]也，所以枙牛頸也。', '釋車第二十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1435, '烏啄', '', '槅，枙馬頸曰烏啄，下向叉馬頸，似烏開口向下啄物時也　。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1436, '隆彊', '', '隆彊，言體隆而彊也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1437, '車弓', '', '隆强，或曰車弓，似弓曲也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1438, '筤', '', '車弓上竹曰朗，疏相遠，晶晶然也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1439, '輹', '複', '輹，複也，重複非一之言也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1440, '网', '', '輞，罔也，罔羅周輪之外也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1441, '輮', '揉', '輞，關西曰輮，言曲揉之也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1442, '民', '緜', '輞，或曰䡑，䡑，緜也，緜連其外也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1443, '輪', '綸', '輪，綸也，彌綸周帀之言也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1444, '鏓', '總', '輪，一曰䡯，言輻聰[總]入轂中也。', '釋車第二十四', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1445, '輿', '舉', '輿，舉也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1446, '軸', '抽', '軸，抽也，入轂中可抽出也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1447, '釭', '空', '釭，空也，其中空也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1448, '鐗', '閒', '鐗，閒也，閒釭軸之閒，使不相摩也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1449, '轄', '害', '轄，害也，車之禁害也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1450, '楇', '裹', '輠，裹也，裹軹頭也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1451, '軹', '指', '軹，指也，如指而見於轂頭也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1452, '笭', '', '笭，橫在車前，織竹作之，孔笭笭也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1453, '盇', '', '葢，在上覆葢人也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1454, '轒', '藩', '軬，藩也，藩蔽水雨也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1455, '轑', '橑', '轑，葢㕚也，如屋構橑也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1456, '杠', '公', '杠，公也，衆㕚所公共也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1457, '俾倪', '䩛齧', '杠，谓之䡟棿，猶祕齧[䩛齧]也，在車軸上，正輪[轑]之祕齧前卻也。', '釋車第二十四', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1458, '轐', '', '轐，似人屐也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1459, '伏兔', '', '轐，一曰伏兔，伏於軸上似之也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1460, '鉤心', '', '鉤心，從輿心下鉤軸也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1461, '𩌏', '縛', '𩌏，縛也，在車下與輿相連縛也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1462, '𣥺', '', '棠，𨅨也，在車兩旁，𨅨幰使不得進卻也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1463, '幰', '煖', '幰，憲[煖]也，所以禦熱也。', '釋車第二十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1464, '紲', '制', '紲，制也，牽制之也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1465, '紛', '放', '紛，放也，防其放㢮，以拘之也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1466, '轡', '咈', '轡，咈也，牽引咈戾，以制馬也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1467, '勒', '絡', '勒，絡也，絡其頭而引之也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1468, '銜', '', '銜，在口中之言也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1469, '鑣', '勹', '鑣，苞[勹]也，在旁苞斂其口也。', '釋車第二十四', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1470, '鞅', '嬰纓', '鞅，嬰也，喉下稱嬰，亦言纓絡之也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1471, '樊纓', '', '鞅下飾曰樊纓，其形樊樊而上屬纓也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1472, '𩎍', '經', '韅，經也，橫經其腹下也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1473, '絆', '', '靽，半[跘]也，拘使半行，不得自縱也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1474, '𦌭', '檢', '䩭，檢也，所以檢持制之也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1475, '繮', '畺', '韁，彊[畺]也，繫之使不得岀彊限也。', '釋車第二十四', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1476, '緧', '逎', '鞧，遒[逎]也，在後遒迫，使不得卻縮也。', '釋車第二十四', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1477, '負', '背', '負，在背上之言也。', '釋車第二十四', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1478, '鞙', '縣', '𩉥，縣也，所以縣縛軛也。', '釋車第二十四', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1479, '船', '循', '船，循也，循水而行也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1480, '舟', '𠣘', '舟，言周[𠣘]流也。', '釋船第二十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1481, '危', '巍', '船前立柱曰桅。桅，巍也，巍巍高貌也。', '釋船第二十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1482, '舳', '拕', '船尾曰柁。柁，拕也，在後見拕曳也；且言弼正船使順流，不得他戾也。', '釋船第二十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1483, '櫓', '旅', '船旁曰櫓。櫓，旅也，用旅力然後舟行也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1484, '筰', '作', '引舟者曰筰。筰，作也；作，起也，起舟使動行也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1485, '擢', '濯', '在旁撥水曰櫂。櫂，濯也，濯於水中也，且言使舟擢進也。', '釋船第二十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1486, '札', '', '在旁撥水曰札，形似札也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1487, '楫', '疌', '在旁撥水曰楫，楫，捷[疌]也，撥水使舟捷疾也。', '釋船第二十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1488, '交', '', '所用斥旁岸曰交，一人前、一人還，相交錯也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1489, '颿', '汎', '隨風張幔曰帆。帆，汎也，使舟疾汎汎然也。', '釋船第二十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1490, '笭窔', '', '舟中牀以薦物者曰笭，言但有簀，如笭牀也。南方人謂之笭穾，言溼漏之水穾然從下過也。', '釋船第二十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1491, '覆', '', '舟上版曰覆，言所以覆慮也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1492, '廬', '', '舟上屋曰廬，象廬舍也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1493, '飛廬', '', '舟上重屋曰飛廬，在上故曰飛也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1494, '爵室', '', '飛廬上曰爵室，於中候望之，如鳥爵之警視也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1495, '先登', '', '軍行在前曰先登，登之先向敵陳也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1496, '冡衝', '', '外狹而長曰艨衝，以衝突敵船也。', '釋船第二十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1497, '赤馬', '', '輕疾者曰赤馬，其體正赤，疾如馬也。', '釋船第二十五', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1498, '檻', '', '上下重版曰艦，四方施版，以禦矢石，其內如牢檻也。', '釋船第二十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1499, '𣟄候', '', '五百斛以上，還有小屋曰斥候，以視敵進退也。', '釋船第二十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1500, '𦩍', '𧜣', '三百斛曰𦩍。𦩍，䂏[𧜣]也；䂏，短也，江南所名短而廣、安不傾危者也。', '釋船第二十五', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1501, '梃', '挺', '二百斛以下曰艇，其形徑挺，一人二人所乘行者也。', '釋船第二十五', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1502, '疾', '', '疾，疾也，客氣中人急疾也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1503, '病', '並', '病，並也，並與正氣在膚體中也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1504, '胗', '診', '疹，診也，有結聚可得診見也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1505, '㝌', '久', '疚，久也，久在體中也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1506, '痛', '通', '痛，通也，通在膚衇中也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1507, '蛘', '揚', '癢，揚也，其氣在皮中，欲得發揚，使人搔發之而揚岀也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1508, '眩', '縣', '眩，縣也，目視動亂，如縣物搖搖然不定也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1509, '歷匘', '', '厯匘，匘正從鼻中出，歷歷然也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1510, '秃', '', '秃，無髪沐秃也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1511, '鬜瘍', '', '毼，頭生創也。頭有創曰瘍，毼亦然也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1512, '盲', '亡', '盲，茫[亡]也，茫茫無所見也。', '釋疾病第二十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1513, '瞽', '鼓', '瞽，鼓也，瞑瞑然目平合如鼓皮也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1514, '矇', '冡', '矇，有眸子而失明，蒙蒙[冡]無所別也　。', '釋疾病第二十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1515, '𥈟', '縮', '瞍，縮也，眸子縮壞也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1516, '睅', '笮', '瞎，迮[笮]也，膚幕迮迫也。', '釋疾病第二十六', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1517, '通視', '', '眸子明而不正曰通視，言視通達目匡一方也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1518, '麗視', '離', '眸子明而不正曰麗視，麗，離也，言一目視天，一目視地，目明分離，所視不同也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1519, '眇', '小', '目匡陷急曰眇，眇，小也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1520, '𥋚', '末', '目眥傷赤曰䁾，䁾，末也，創在目兩末也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1521, '浸', '侵', '目生膚入眸子曰浸。浸，侵也，言侵明也。亦言浸淫轉大也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1522, '聾', '籠', '聾，籠也，如在蒙籠之內，不可察也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1523, '鼽', '久', '鼻塞曰鼽。鼽，久也，涕久不通，遂至窒塞也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1524, '齲', '朽', '齲，朽也，蟲齧之齒缺朽也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1525, '瘖', '奄', '瘖，唵[奄]也，唵然無聲也。', '釋疾病第二十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1526, '癭', '嬰', '癭，嬰也，在頸嬰喉下也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1527, '癰喉', '', '癰喉，氣著喉中不通，稸成癰也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1528, '消㵣', '', '消㵣，㵣，渴也，腎氣不周於胸胃中，津潤消渴，故欲得水也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1529, '嘔', '傴', '嘔，傴也，將有所吐，脊曲傴也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1530, '欬', '刻', '欬，刻也，氣奔至，出入不平調，若刻物也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1531, '喘', '湍', '喘，湍也；湍，疾也，氣岀入湍疾也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1532, '吐', '寫', '吐，瀉[寫]也，故揚 豫以東謂瀉爲吐也。', '釋疾病第二十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1533, '妬', '𢾅', '乳癰曰妬。妬，褚[𢾅]也，氣積褚不通，至腫潰也。', '釋疾病第二十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1534, '疝', '駪', '心痛曰疝。疝，詵[駪]也，氣詵詵然上而痛也。', '釋疾病第二十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1535, '痞', '否', '脴，否也，氣否結也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1536, '哺露', '', '小兒氣結曰哺露，哺而寒露，乳食不消，生此疾也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1537, '注病', '', '注病，一人死、一人復得，氣相灌注也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1538, '渫利', '', '泄利，言其出漏泄而利也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1539, '滯', '', '下重而赤白曰䐭，言厲䐭而難差也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1540, '隤', '', '陰腫曰隤，氣下隤也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1541, '疝', '詵', '陰腫亦曰疝，疝，詵也，詵詵引小腹急痛也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1542, '疼痹', '', '疼痹，痹氣疼疼然煩也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1543, '痔', '食', '痔，食也，蟲食之也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1544, '酸', '遜', '酸，遜也，遜遁在後也。言腳疼力少，行道在後，似遜遁者也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1545, '消', '削', '消，削也，如見割削，筋力弱也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1546, '懈', '解', '懈，解也，骨節解緩也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1547, '厥逆', '', '厥逆，逆氣從下厥起，上行入心脅也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1548, '瘧', '虐', '瘧，虐也。凡疾，或寒或熱耳，而此疾先寒後熱，兩疾似酷虐者也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1549, '疥', '齘', '疥，齘也，癢搔之，齒䫴齘也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1550, '癬', '徙', '癬，徙也，浸淫移徙處日廣也，故靑、徐謂癬爲徙也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1551, '胗', '展', '胗，展也，癢搔之，捷展起也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1552, '腫', '鍾', '腫，鍾也，寒熱氣所鍾聚也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1553, '癰', '邕', '癰，壅[邕]也，氣壅否結裹而潰也。', '釋疾病第二十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1554, '痳', '𠘡', '痳，懍[𠘡]也，小便難，懍懍然也。', '釋疾病第二十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1555, '創', '戕', '創，戕也，戕毀體使傷也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1556, '痍', '侈', '痍，侈也，侈開皮膚爲創也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1557, '瘢', '曼', '瘢，漫[曼]也，生漫故皮也。', '釋疾病第二十六', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1558, '痕', '很', '痕，拫也，急相拫引也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1559, '瘤', '流', '癅，流也，血流聚所生癅腫也。', '釋疾病第二十六', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1560, '贅', '', '贅，屬也，橫生一肉，屬著體也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1561, '肬', '丘', '肬，丘也，出皮上，聚高如地之有丘也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1562, '欶', '促', '欶欶，促也，用力急促也。', '釋疾病第二十六', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1563, '死', '澌', '人始氣絕曰死。死，澌也，就消澌也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1564, '不祿', '', '士曰不祿，不復食祿也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1565, '卒', '', '大夫曰卒，言卒竟也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1566, '薨', '', '諸侯曰薨。薨壞之聲也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1567, '崩', '', '天子曰崩，崩壞之形也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1568, '殪', '翳', '殪，翳也，就隱翳也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1569, '䢐落', '祚', '徂落，徂，祚也，福祚殞落也。徂，亦言往也，往去落也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1570, '殺', '竄', '罪人曰殺。殺，竄也，埋竄之，使不復見也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1571, '誅', '殊', '罪及餘人曰誅。誅，株[殊]也，如株木根，枝葉盡落也。', '釋喪制第二十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1572, '㲻', '弱', '死於水者曰溺。溺，弱也，不能自勝之言也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1573, '燒', '焦', '死於火者曰燒。燒，燋[焦]也。', '釋喪制第二十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1574, '兵', '', '戰死曰兵，言死爲兵所傷也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1575, '弑', '伺', '下殺上曰弑。弑，伺也，伺閒而後得施也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1576, '縊', '阨', '縣繩曰縊。縊，阨也，阨其頸也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1577, '雉經', '', '屈頸閉氣曰雉經，如雉之爲也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1578, '攷竟', '', '獄死曰考竟，考得其情，竟其命於獄也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1579, '弃市', '', '市死曰弃市。市，衆所聚，言與衆人共弃之也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1580, '斬', '暫', '斫頭曰斬，斫要曰要斬。斬，暫也，暫加兵即斷也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1581, '轘', '散', '車裂曰轘。轘，散也，肢體分散也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1582, '亯', '', '煮之於鑊曰烹，若烹禽獸之肉也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1583, '掠', '狼', '槌而死者曰掠。掠，狼也，用威大暴，如犲狼也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1584, '壽終', '', '老死曰壽終。壽，久也；終，盡也。生巳久遠，氣終盡也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1585, '夭', '', '少壯而死曰夭，如取物中夭折也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1586, '殤', '傷', '未二十而死曰殤。殤，傷也，可哀傷也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1587, '考', '槁', '父死曰考。考，成也。亦言槁也，槁於義爲成。凡五材：膠、漆、陶、冶、皮革，乾槁乃成也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1588, '妣', '比', '母死曰妣。妣，比也，比之於父亦然也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1589, '物故', '', '漢以來謂死爲物故，言其諸物皆就朽故也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1590, '屍', '舒', '既定死曰尸。尸，舒也，骨節解舒，不復能自勝斂也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1591, '襲', '帀', '衣尸曰襲。襲，帀也，以衣周帀，覆衣之也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1592, '冒', '', '以囊韜其形曰冒，覆冒其形，使人勿惡也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1593, '絞衿', '交禁', '巳衣，所以束之曰絞衿。絞，交也，交結之也；衿，禁也，禁繫之也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1594, '琀', '含', '含，以珠貝含其口中也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1595, '握', '', '握，以物著尸手中，使握之也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1596, '斂', '', '衣尸棺曰斂，斂藏不復見也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1597, '棺', '關', '棺，關也，言關閉也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1598, '椁', '郭', '槨，廓[郭]也，廓落在表之言也。', '釋喪制第二十七', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1599, '柩', '究', '尸巳在棺曰柩。柩，究也，送終隨身之制皆究備也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1600, '殯', '賓', '於西壁下塗之曰殯。殯，賓也，賓客遇之，言稍遠也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1601, '欑', '儹', '於西壁下塗之曰欑，攢[儹]木於上而塗之也。', '釋喪制第二十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1602, '縗', '摧', '三日不生，生者成服曰縗。縗，摧也，言傷摧也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1603, '縗', '摧', '縗，摧也，言傷摧也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1604, '絰', '實', '絰，實也，傷摧之實也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1605, '絞帶', '', '絞帶，絞麻繩爲帶也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1606, '斬', '', '三年之縗曰斬，不緝其末，直翦斬而巳。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1607, '𪗋', '齊', '期[稘]曰𪗋。𪗋，齊也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1608, '大功', '', '九月曰大功，其布加麤大之功，不善治練之也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1609, '小功', '', '五月曰小功，精細之功，小有飾也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1610, '緦麻', '絲', '三月曰緦麻，緦，絲也，績麻細如絲也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1611, '緆縗', '易', '錫縗，錫，易也，治其麻，使滑易也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1612, '疑縗', '', '疑縗，疑，儗也，儗於吉也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1613, '繐縗', '', '繐縗，細疏如繐也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1614, '環絰', '', '環絰，末無餘散麻，圓如環也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1615, '㝸絰', '', '弁絰，如爵弁而素加絰也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1616, '重', '', '重，死者之資重也。含餘米以爲粥，投之甕而縣之，比葬，未作主權，以重主其神也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1617, '葬', '臧', '葬，藏[臧]也。', '釋喪制第二十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1618, '壙', '曠', '壙，曠也，藏於空曠處也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1619, '輀', '而', '輿棺之車曰輀。輀，耏[而]也，縣於左右前後，銅魚搖絞之屬耏耏然也。', '釋喪制第二十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1620, '柳', '僂', '輿棺之葢曰柳。柳，聚也，衆飾所聚也，亦言其形僂也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1621, '鼈甲', '', '輿棺之葢曰鼈甲，似鼈甲然也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1622, '牆', '', '輿棺之旁曰牆，似屋牆也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1623, '翣', '箑', '翣，齊人謂扇爲翣[箑]，此似之也，象翣扇爲淸涼也。', '釋喪制第二十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1624, '黼黻畫', '', '翣有黼、有黻、有畫，各以其飾名之也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1625, '㗗', '', '兩旁引之曰披。披，擺也，各於一旁引擺之，備傾倚也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1626, '紼', '發', '從前引之曰紼。紼，發也，發車使前也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1627, '率', '', '縣下壙曰繂。繂，將[𢪇]也，徐徐將下之也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1628, '緘', '圅', '棺束曰緘。緘，函[圅]也，古者棺不釘也。', '釋喪制第二十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1629, '小要', '', '棺束旁際曰小要，其要約小也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1630, '衽', '任', '棺束旁際曰袵。袵，任也，任制際會，使不解也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1631, '明器', '', '送死之器曰明器，神明之器，異於人也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1632, '涂車', '', '塗車，以泥塗爲車也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1633, '芻靈', '', '芻靈，束草爲人馬，以神靈名之也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1634, '奠', '亭', '喪祭曰奠。奠，停[亭]也，言停久也。', '釋喪制第二十七', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1635, '樸奠', '', '奠，一曰樸奠，合體用之也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1636, '殷奠', '', '朔朢祭曰殷奠，所用殷衆也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1637, '娛', '', '既葬，還祭於殯宮曰虞，謂虞樂安神，使還此也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1638, '卒哭', '', '又祭曰卒哭。卒，止也，止孝子無時之哭，朝夕而巳也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1639, '祔祭', '', '又祭曰祔祭，祭於祖廟以後死，孫祔於祖也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1640, '小祥', '', '期而小祥，亦祭名也，孝子除首絰、服練冠也。祥，善也，加小善之飾也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1641, '大祥', '', '又期而大祥，亦祭名也，孝子除縗服，服朝服、縞冠，加大善之飾也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1642, '禫', '澹', '閒月而禫，亦祭名也，孝子之意澹然，哀思益衰也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1643, '冢', '腫', '冢，腫也，象山頂之高腫起也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1644, '墓', '慕', '墓，慕也，孝子思慕之處也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1645, '丘陵', '', '丘，象丘形也。陵亦然也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1646, '殔', '翳', '假葬於道側曰肂。肂，翳也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1647, '㵣', '', '日月未滿而葬曰渴，言渴欲速葬，無恩也。', '釋喪制第二十七', '释名', '1', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1648, '慢', '', '過時而不葬曰慢，謂慢傲不念早安神也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1649, '薶', '墨', '葬不如禮曰埋。埋，痗[墨]也，趨使痗腐而巳也。', '釋喪制第二十七', '释名', '1;2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1650, '弃', '', '不得埋之曰弃，謂弃之於野也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1651, '捐', '', '不得其尸曰捐，捐於他境也。', '釋喪制第二十七', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1652, '律呂', '率述旅', '律呂。律，率也，所以率氣令生也。亦言述也，述氣者也。呂，旅也，旅陽宣氣也。六律爲陽，六呂爲陰，凡十有二。陽足以包陰，則單言六律。陽足以統陰，則呂亦稱律，總言十二律。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1653, '六同', '', '六呂，一曰六同，助陽宣氣，與同功也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1654, '六閒', '', '六呂，一曰六閒，在陽律之閒也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1655, '黄鐘', '種踵動', '黄鐘，十一月之律，子之氣也。鐘，種也，陽氣施種於黄泉，孳萌萬物，爲六氣元也。一曰鐘，踵也，陽氣踵黄泉而出也。一曰鐘，動也，言陽氣動於黄泉之下，養萬物也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1656, '大呂', '旅歫', '大呂，十二月之律，丑之氣也。呂，旅也，言陰大旅助黄鐘，宣氣而牙物也。一曰呂，拒[歫]也，言陽氣欲出，陰不許，旅抑拒難之也。', '釋名佚文一：釋律呂', '释名', '2', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1657, '太蔟', '大奏湊', '太蔟，正月之律，寅之氣也，言萬物蔟生也，故曰泰蔟。一曰蔟，奏也，言陽氣大奏地而達物也。一曰太，大也。蔟，湊也，言萬物始大，湊地而出也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1658, '夾鐘', '甲種', '夾鐘，二月之律，卯之氣也，言陰夾助太簇，宣四方之氣，而出種物也。一曰言陰陽相夾廁也：一曰夾，孚甲也，言萬物孚甲，種類分也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1659, '姑洗', '故鮮', '姑洗，三月之律，辰之氣也。姑，故也。洗，鮮也，言萬物皆去故就新，莫不鮮明也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1660, '仲呂', '旅中', '仲呂，四月之律，巳之氣也。言微陰始起，未成箸，于其中旅助姑洗，宣氣齊物也。仲之言中也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1661, '蕤賓', '垂儐', '蕤賓，五月之律，午之氣也。蕤，垂也。賓，儐也，言陰氣始起，陽氣自上下垂，儐導之也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1662, '林鐘', '衆種', '林鐘，六月之律，未之氣也。林，衆也，言萬物成孰，種類衆多也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1663, '夷則', '痍賊', '夷則，七月之律，申之氣也。夷，痍也。痍，傷也。則，賊也，言萬物傷痍，爲陰氣賊害也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1664, '南呂', '任旅', '南呂，八月之律，酉之氣也。南，任也，言陰氣旅助夷則，任成萬物也。一曰言陽氣尚有任生薺麥也，故陰拒之也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1665, '無射', '斁', '無射，九月之律，戌之氣也。射，斁也。斁，厭也。言陽氣究物，而使陰氣畢剥落之，終而復始，無厭巳也。一曰斁，終也，言萬物隨陽而終，當復隨陰而起，無有終巳也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1666, '應鐘', '種動', '應鐘，十月之律，亥之氣也。言陰氣應無射，該藏萬物，而雜陽閡種也。一曰應鐘者，陽氣之應，不用事也。一曰應者，應也。鐘者，動也。言萬物應陽而動，下藏也。', '釋名佚文一：釋律呂', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1667, '五音', '飲', '五聲。聲者，鳴也。亦曰五音。音者，飲也，言其剛柔清濁和而相飲也。', '釋名佚文二：釋五聲', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1668, '宮', '', '宮，中也，居中央，暢（亦作鬯）四方，倡始施生，爲四聲綱也。一曰宮，容也、含也，含容四時者也。', '釋名佚文二：釋五聲', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1669, '商', '', '商，章也，物成孰可章度也。一曰商者，張也，陰氣開張，陽氣始降也。', '釋名佚文二：釋五聲', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1670, '角', '', '角，觸也，物觸地而出，戴芒角也。一曰角者，躍也，陽氣動躍。', '釋名佚文二：釋五聲', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1671, '徵', '祉止', '徵，祉也，物盛大而繁祉也。一曰徵者，止也，陽氣止。', '釋名佚文二：釋五聲', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1672, '䨒', '宇紆', '䨒，宇也，物聚藏，宇覆之也。一曰䨒者，紆也，陰氣在上、陽氣在下紆回也。', '釋名佚文二：釋五聲', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1673, '三公', '貢', '三公。公，貢也，才德兼于人，人咸貢薦于王而用之也。韋辯之曰：公猶取正直無厶也，故公字从八厶。', '釋名佚文三：釋爵位', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1674, '尚書', '上', '尚書。尚，上也，言最在上總領之也。韋辯之曰：尚猶奉也，百官言事，當省案平處奉之，故曰尚書。尚食、尚方亦然。', '釋名佚文三：釋爵位', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1675, '御史中丞', '', '御史中丞，居中丞相者也。韋辯之曰：此中丞自御史大夫下，氶有二，其一别居殿中，舉不法，故曰中丞。', '釋名佚文三：釋爵位', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1676, '卿', '慶章', '卿，慶也，言萬國皆慶賴之也。又卿，章也，言貴盛章著也。', '釋名佚文三：釋爵位', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1677, '大鴻臚', '', '大鴻臚，腹前肥者曰臚，此主王侯及蕃國言，以京師爲心體，王侯外國爲腹臚，以養之也。韋辯之曰：其職本故典客，掌賓禮，武帝時更爲鴻臚。鸿，大也。臚，敘也，欲大以禮敶敘賓客也。', '釋名佚文三：釋爵位', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1678, '平準令', '', '平準令主染色，色有常平之法準的之也。韋辯之曰：其職主平物賈，使相依準。', '釋名佚文三：釋爵位', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1679, '祭酒', '', '祭酒者，謂祭六神以酒餟之也。', '釋名佚文三：釋爵位', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1680, '升布', '', '祭雨曰升，祭星曰布，升取其氣之升也，布取其象之布也。', '釋名佚文四：其他', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1681, '臣', '慎', '臣，慎也，慎于其事，以奉上也。', '附韋昭釋名：官職訓', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1682, '大司馬', '武', '大司馬，馬，武也，大總武事也。大司馬掌軍。古者兵車，一車四馬，故以馬名官。', '附韋昭辯釋名', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1683, '廷尉縣尉', '罰', '廷尉、縣尉，皆古官也，以尉尉民心也。凡掌賊及司察之官皆曰尉。尉，罰也，言以辠罰姦非也。', '附韋昭辯釋名', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1684, '祭酒', '', '祭酒，凡會同饗燕，必尊長先用，先用，必以酒祭先，故曰祭酒。漢時，吴王年長，以爲劉氏祭酒是也。', '附韋昭辯釋名', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1685, '奉車都尉', '', '奉車都尉，主乘舆。乘輿尊，不敢言主，故言奉。', '附韋昭辯釋名', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1686, '太中大夫', '', '太中大夫，在中最爲高大也。', '附韋昭辯釋名', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1687, '郡尉', '', '郡尉，羅姦非。', '附韋昭辯釋名', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1688, '督郵', '', '督郵，主諸縣罰，以負督郵殷糾攝之也。', '附韋昭辯釋名', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1689, '功曹', '', '功曹。曹，羣也。功曹，吏所羣聚。户曹，民所羣聚也。其他皆然。', '附韋昭辯釋名', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1690, '主薄', '', '主薄，主諸薄書。薄，普關諸事。', '附韋昭辯釋名', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1691, '吏', '職', '門下之吏，當作三綱，幼未有用，從容在職也。', '附韋昭辯釋名', '释名', '', 'null', 'null');
INSERT INTO `t_han_etymology` VALUES (1692, '伍佰', '', '五百，字本爲伍佰。伍，當也。佰，道也，使之導引當道佰中，以驅除也。今俗呼行杖人爲五百。', '附韋昭辯釋名', '释名', '', 'null', 'null');
